(1,	'GENERAL MANAGER',	'general-manager',	1,	10,	155,	NULL,	NULL,	NULL,	'Good command of spoken and written English.\r\nMust have at least 2 years’ of accounting experience at a senior level.\r\n.Competent with XERO software, Microsoft Excel, Word, Outlook.\r\nExperienced in Accounts Payable & Accounts Receivables.\r\nExperienced in preparing and lodging Payroll, VAT & VNPF Returns.\r\nExperienced in preparing and reconciling Petty Cash and banking\r\nAble to perform assigned tasks quickly and accurately within set deadlines.\r\nBe willing to perform admin duties in other departments if required.\r\nAs we are in hospitality, we prefer someone who is able to work weekends if required.',	'01736141008',	1,	1,	'nayeemsarwar1275@gmail.com',	NULL,	'uploads/addss_image/1680512192_642a94c0a81d6.jpg',	'active',	0,	'no',	0,	83,	0,	NULL,	'2023-04-03 19:56:32',	'2023-06-23 07:51:29',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'321',	NULL,	16,	NULL,	NULL,	'Masters / MBA',	1,	23,	'2023-04-18 00:00:00',	'JASHIM',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(2,	'ENGLISH LECTURER',	'english-lecturer',	1,	10,	146,	NULL,	NULL,	NULL,	'The National University of Vanuatu is actively recruiting for a part-time English Lecturer for Years 1 and 2 of the Bachelor in Tourism and Hospitality.',	'01736141008',	1,	1,	'nayeemsarwar1275@gmail.com',	NULL,	'uploads/addss_image/1680512565_642a9635eb586.jpg',	'active',	0,	'no',	0,	82,	0,	NULL,	'2023-04-03 20:02:45',	'2023-06-23 06:29:28',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'321',	NULL,	23,	NULL,	'10',	'phD / Doctorate',	500000,	100000,	'2023-04-10 00:00:00',	'JASHIM',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(3,	'ACCOUNTS ADMIN OFFICER',	'accounts-admin-officer',	1,	10,	132,	NULL,	NULL,	NULL,	'The Accounts Administrator will be supervised by the Program Manager. The key responsibility is to ensure that all accounting entries on MYOB are undertaken in an accurate and timely manner, within 2 weeks of the completion of each month. The Accounts Administrator will work as a team member with the Program Manager, and other accounting/finance staff; all team members will work together in a supportive manner to ensure that all urgent tasks are completed as required and on time by the finance team as a whole. The Program Manager will identify which donor accounts each Accounts Administrator will work on.',	'098787',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680513450_642a99aa65e5f.png',	'active',	0,	'no',	0,	57,	0,	NULL,	'2023-04-03 20:17:30',	'2023-06-21 12:19:52',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'432',	NULL,	21,	NULL,	NULL,	'phD / Doctorate',	400000,	500000,	'2023-04-18 00:00:00',	'Nasim',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(4,	'CREDIT CONTROLLER',	'credit-controller',	1,	10,	146,	NULL,	NULL,	NULL,	'We are a longstanding firm with our office in central Port Vila.We invite applications for our newly created position of Credit Controller.\r\n\r\nThe successful applicant will need good interpersonal skills. They will need to have an outgoing and engaging personality and be confident engaging with clients.\r\n\r\nThey should be fluent in English and Bislama. Some French language ability would be of assistance.\r\nThey should have good computer skills and an understanding of accounting practices',	'98987',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680514246_642a9cc649891.png',	'active',	0,	'no',	0,	56,	0,	NULL,	'2023-04-03 20:30:46',	'2023-06-24 03:34:14',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'456',	NULL,	25,	NULL,	NULL,	'phD / Doctorate',	40000,	600000,	'2023-04-11 00:00:00',	'Sabir',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(5,	'CHIEF EXECUTIVE OFFICER',	'chief-executive-officer',	1,	10,	146,	NULL,	NULL,	NULL,	'As the Chief Executive Officer of Air Vanuatu (Operations) Limited, you plays a pivotal role in supporting national development, particularly tourism. The position will be based at Air Vanuatu Head Office, and Port Vila, Vanuatu and will report directly to the Board of Directors. The CEO position has an extreme level of responsibility in providing necessary leadership in the daily management of the airline. The CEO will manage the business through an essential restructuring program, whilst maintaining the airline’s core values of Safety, Efficiency, Quality, Service, Reputation and Financial responsibility. I',	'8956',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680514526_642a9dde04e1c.jpeg',	'active',	0,	'no',	0,	60,	0,	NULL,	'2023-04-03 20:35:26',	'2023-06-23 20:50:11',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'342',	NULL,	20,	NULL,	NULL,	'phD / Doctorate',	45000,	60000,	'2023-04-18 00:00:00',	'sajeb',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
