(7,	'PROCUREMENT AND FINANCE OFFICER',	'procurement-and-finance-officer',	1,	10,	155,	NULL,	NULL,	NULL,	'The goal of the Vanuatu Health Program (VHP) is to support the Ministry of Health (MoH) achieve the health objectives of the NSDP and its commitment to the delivery of health services demanded at national, provincial, and local levels for a healthy, secure and productive population .The end of program outcomes (EOPOs) are:\r\n\r\n(a) Ministry of Health (MoH) senior staff lead continuous improvement and strengthened accountability of the Vanuatu health sector; and\r\n\r\n(b) MoH corporate services, public health and clinic services staff increase delivery of\r\nequitable, accessible and better-quality essential health services',	'98987',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680517465_642aa959441e1.png',	'active',	0,	'no',	0,	66,	0,	NULL,	'2023-04-03 21:24:25',	'2023-06-21 14:09:11',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'321',	NULL,	24,	NULL,	'4',	'Masters / MBA',	40000,	500000,	'2023-04-10 00:00:00',	'John',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
