(9,	'SENIOR ACCOUNTS OFFICER',	'senior-accounts-officer',	1,	10,	NULL,	NULL,	NULL,	NULL,	'Good command of spoken and written English.\r\nMust have at least 2 years’ of accounting experience at a senior level.\r\n.Competent with XERO software, Microsoft Excel, Word, Outlook.\r\nExperienced in Accounts Payable & Accounts Receivables.\r\nExperienced in preparing and lodging Payroll, VAT & VNPF Returns.\r\nExperienced in preparing and reconciling Petty Cash and banking\r\nAble to perform assigned tasks quickly and accurately within set deadlines.\r\nBe willing to perform admin duties in other departments if required.\r\nAs we are in hospitality, we prefer someone who is able to work weekends if required.',	'78997',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680518214_642aac461a6e2.jpg',	'active',	0,	'no',	0,	17,	0,	NULL,	'2023-04-03 21:36:54',	'2023-06-22 08:11:04',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'467',	NULL,	18,	NULL,	'6',	'Diploma',	35000,	44999,	'2023-04-11 00:00:00',	'rajus',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(10,	'CHIEF EXECUTIVE OFFICER',	'chief-executive-officer-10',	1,	10,	146,	NULL,	NULL,	NULL,	'As the Chief Executive Officer of Air Vanuatu (Operations) Limited, you plays a pivotal role in supporting national development, particularly tourism. The position will be based at Air Vanuatu Head Office, and Port Vila, Vanuatu and will report directly to the Board of Directors. The CEO position has an extreme level of responsibility in providing necessary leadership in the daily management of the airline. The CEO will manage the business through an essential restructuring program, whilst maintaining the airline’s core values of Safety, Efficiency, Quality, Service, Reputation and Financial responsibility. It is also essential to continue to enhance aggressive cost reduction and revenue enhancement strategies.',	'98987',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680518397_642aacfd233f1.jpeg',	'active',	0,	'no',	0,	25,	0,	NULL,	'2023-04-03 21:39:57',	'2023-06-21 21:57:20',	', Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'678',	NULL,	20,	NULL,	'5',	'Masters / MBA',	35000,	50000,	'2023-04-10 00:00:00',	'safon',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(11,	'REQUEST FOR TENDER (RFQ)',	'request-for-tender-rfq',	1,	10,	146,	NULL,	NULL,	NULL,	'The Vanuatu Health Program (VHP) is to support the Ministry of Health (MOH) achieve the health objectives of the NSDP and its commitment to the delivery of health services demanded at National, provincial and local levels for a healthy, secure and productive population.\r\n\r\nThe Vanuatu Health Program invites you to submit your tender for providing the\r\nproducts/services as described herein.',	'98987',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680519341_642ab0ad41f70.png',	'active',	0,	'no',	0,	29,	0,	NULL,	'2023-04-03 21:55:41',	'2023-06-21 12:43:44',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'456',	NULL,	28,	NULL,	'5',	'Honors / BBA',	23000,	30000,	'2023-04-10 00:00:00',	'Nasim',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(12,	'FINANCE MANAGER',	'finance-manager',	1,	10,	146,	NULL,	NULL,	NULL,	'The Finance Manager is responsible for all financial aspects of ADRA Vanuatu office and will provide effective accounting services and financial support to administration and project teams.',	'6786',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680519632_642ab1d04f8a0.png',	'active',	0,	'no',	0,	22,	0,	NULL,	'2023-04-03 22:00:32',	'2023-06-21 12:34:54',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'890',	NULL,	19,	NULL,	'5',	'phD / Doctorate',	60000,	700000,	'2023-04-10 00:00:00',	'dasik',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(13,	'HEAD CHEF',	'head-chef',	1,	10,	146,	NULL,	NULL,	NULL,	'The Espiritu is seeking an Experienced Head Chef to join their amazing Team.\r\nIf you have proven experience, are creative & passionate about cooking, have excellent communication skills, can manage a team, is honest, hardworking, and motivated, and want a fantastic future, you belong here at The Espiritu.',	'98987',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680519887_642ab2cf46e0b.jpg',	'active',	0,	'no',	0,	24,	0,	NULL,	'2023-04-03 22:04:47',	'2023-06-21 13:56:43',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'321',	NULL,	29,	NULL,	'5',	'phD / Doctorate',	40000,	50000,	'2023-04-10 00:00:00',	'sakir',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(14,	'LOCAL DIRECTOR – VANUATU',	'local-director-vanuatu',	1,	10,	132,	NULL,	NULL,	NULL,	'An excellent opportunity for a locally based financial services candidate to join a dynamic and rapidly expanding financial services company looking to establish a presence in Vanuatu\r\n\r\nGleneagle Securities Services Pty Ltd is incorporated as a local company in Vanuatu and will act as a services company to Gleneagle Securities Pty Ltd, a licensed Securities Dealer in Vanuatu, registered and regulated by the Vanuatu Financial Services Commission under Company Number 40256.',	'34577',	1,	1,	'info@everisamting.com',	NULL,	NULL,	'active',	0,	'no',	0,	25,	0,	NULL,	'2023-04-03 22:07:09',	'2023-06-23 20:34:10',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'321',	NULL,	30,	NULL,	NULL,	'Masters / MBA',	30000,	400000,	'2023-04-26 00:00:00',	'rahul',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(15,	'LIFESTYLE BUSINESS WITH OVER 17 HECTARES OF WATERHOLES AND LUSH LAND',	'lifestyle-business-with-over-17-hectares-of-waterholes-and-lush-land',	1,	33,	213,	NULL,	NULL,	170000000.00,	'Wow, Wow, Wow, Just 25 minutes from Port Vila you will find this magical and tranquil paradise called Eden on the River. This Exhilarating and beautiful property offers so many tourism options:\r\nOver 17 hectares of land, over 300m of river, amazing natural swimming holes of pristine crystal blue/green water, rope bridges, zip lining over the river, a grassed 18 hole mini golf course, amazing tropical gardens of flowers and fruits, trekking through the magnificent landscape, obstacle courses for children ,adventure playground and an animal zoo with cows, goats, pigs, chickens, ducks, coconut crabs, lizards, birds etc. The activities at the property are truly a magical experience for all.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680581838_642ba4ce83206.jpg',	'active',	0,	'no',	0,	28,	0,	NULL,	'2023-04-04 15:17:18',	'2023-06-24 01:11:52',	'Land Area',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'used',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL),
(16,	'0 UNDINE BAY MARINA ESTATE  ID: 85023',	'0-undine-bay-marina-estate-id-85023',	1,	26,	186,	NULL,	NULL,	160000000.00,	'Undine Bay Marina Estate Lot 80, Port Vila Vanuatu\r\nPart of the prestigious Undine Bay Marina Estate development, this huge piece of land is 48,641m2 (which is approximately12 acres).\r\n\r\nWith170 metres of beach frontage it is a beautiful site. Approximately 290m from the boundary on the main ring road this piece of land is referred to as the \'Western Hotel Site\'.\r\n\r\nWhile the overall plan has always seen this property to be used for a hotel site with the Undine Bay Marina Canal being extended under the road and bridged so hotel guests can go by small boat directly out to sea, the options really are endless with a beach front property this size.\r\n\r\nThere is a good water source with many options factored into the plan.\r\n\r\nThe site is North facing and relatively flat but there is an elevated area of about 2m above MSL which provides a good natural site for construction and infrastructure.\r\n\r\nPlease le me know if you have any further enquiries.',	'+678 7757495',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680582317_642ba6ad30aab.jpg',	'active',	0,	'no',	0,	17,	0,	NULL,	'2023-04-04 15:25:17',	'2023-06-24 01:44:31',	'Land Area 48641m² Frontage 170m',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL),
(17,	'9 Dream Cove ID: 142550',	'9-dream-cove-id-142550',	1,	19,	NULL,	NULL,	NULL,	138000000.00,	'Prestigious Location and Luxury home in Port Vila\r\nLocated in the most prestigious estate in Port Vila, this beautifully designed property is absolute luxury on the sale market here in Vanuatu.\r\n\r\nThis single level property offers spectacular views from the minute you walk in. It’s been solidly constructed on an elevated block with breathtaking views over the ocean and the forest covered coral cliffs behind. Not only are the natural views breathtaking, the gardens on the property are amongst the best that I have seen. Meticulously landscaped with local tropical and overseas imported plants you will smell the aromas and have beautiful flowering plants to enjoy, as well as a vegetable patch, numerous fruits trees and a strawberry patch, all retained with natural Vanuatu coral.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680582732_642ba84cdd21d.jpg',	'active',	0,	'no',	0,	22,	0,	NULL,	'2023-04-04 15:32:12',	'2023-06-17 18:19:42',	'Port Vila City',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'new',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL),
(18,	'COMPUTING OFFICER',	'computing-officer',	3,	10,	339,	NULL,	NULL,	NULL,	'Are you energetic, ready to learn and passionate about Vanuatu’s digital future?\r\n\r\nHSEQ Vanuatu is growing fast and seeking additional savvy IT people to join our team. We are a consulting and digital technology business located in Port Vila working on IT projects with varied Vanuatu and International clients.\r\n\r\nInterested in servers? Please don’t apply! Our team looks to the future working with the latest cloud-based digital applications and platforms to deliver diverse projects to our clients.',	'34577',	1,	1,	'farukrahman@gmail.com',	NULL,	'uploads/addss_image/1680582774_642ba87680dec.png',	'active',	0,	'no',	0,	19,	0,	NULL,	'2023-04-04 15:32:54',	'2023-06-21 09:57:53',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'456',	NULL,	31,	NULL,	'5',	'Masters / MBA',	40000,	50000,	'2023-04-11 00:00:00',	'sev',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
