(20,	'OFFICE COORDINATOR',	'office-coordinator',	3,	10,	146,	NULL,	NULL,	NULL,	'Titan FX is a regulated securities dealer based in Port Vila, Vanuatu. The company operates the Titan FX brand offering forex and CFD brokerage to traders globally. Titan FX differentiates itself from other brokers by investing in product development and outstanding customer service rather than sales and advertising.\r\n\r\nTitan FX prides itself in offering employee training and career-developing working conditions.',	'6786',	1,	1,	'farukrahman@gmail.com',	NULL,	'uploads/addss_image/1680583074_642ba9a29d608.jpg',	'active',	0,	'no',	0,	28,	0,	NULL,	'2023-04-04 15:37:54',	'2023-06-21 20:39:09',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'678',	NULL,	32,	NULL,	'5',	'Masters / MBA',	50000,	60000,	'2023-04-10 00:00:00',	'michel',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(21,	'EMPLOYMENT OPPORTUNITY : PROCUREMENT & LOGISTICS OFFICER',	'employment-opportunity-procurement-logistics-officer',	3,	10,	155,	NULL,	NULL,	NULL,	'World Vision Vanuatu is a Christian humanitarian organization dedicated to work with children, families and communities to overcome poverty and injustice. Since 1981, we have been working to transform communities through delivering programming in education, health, water and sanitation, gender relations, agriculture, and resilient livelihoods. In line with the Vanuatu Government’s National Sustainable Development Plan Vanuatu 2030: The People’s Plan, World Vision – in partnership with communities – delivers programs that are relevant, cost-efficient, effective, and make a lasting difference.\r\n\r\nWorld Vision Vanuatu is now recruiting for a Procurement & Logistics Officer to be based in World Vision Country Program Office in Port Vila. The Procurement & Logistics Officer will;',	'6786',	1,	1,	'farukrahman@gmail.com',	NULL,	'uploads/addss_image/1680583249_642baa51061d7.png',	'active',	0,	'no',	0,	62,	0,	NULL,	'2023-04-04 15:40:49',	'2023-06-21 18:44:50',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'578',	NULL,	33,	NULL,	'6',	'Masters / MBA',	40000,	55000,	'2023-04-11 00:00:00',	'viko',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(22,	'RPL ASSESSMENT CENTERS',	'rpl-assessment-centers',	3,	10,	146,	NULL,	NULL,	NULL,	'To all interested business houses and registered Post-School Education and Training providers (Re-advertised)  Vanuatu Qualifications Authority has established and launched the Skills and Qualifications Recognition Services.  VQA will soon start implementing the recognition services with the assistance of Recognition of Prior Learning (RPL) Assessment Centers. Those who apply or interested to become RPL Assessment Centers will participate on a RPL Capacity Building Workshop in March 2023.',	'78997',	1,	1,	'farukrahman@gmail.com',	NULL,	'uploads/addss_image/1680583457_642bab212b8dd.png',	'active',	0,	'no',	0,	21,	0,	NULL,	'2023-04-04 15:44:17',	'2023-06-21 22:18:24',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'345',	NULL,	34,	NULL,	'9',	'Masters / MBA',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(23,	'Bellevue - ID: 254322',	'bellevue-id-254322',	1,	2,	56,	NULL,	NULL,	NULL,	'Stunning Bellevue Dream\r\n\r\n115,000,000 vatu\r\n\r\nStunning Bellevue Dream\r\n\r\nLocated at popular Bellevue this majestic home is set on a large 1973m2 property. They don’t build homes like this anymore. It is solid as a rock. All laid to grass with mature trees, plants and flowers. This is what dreams are made of. Located in a quiet cul-de-sac road, you enter the property via the electric gates. On entering this home it definitely has the “WOW’ factor.\r\n\r\nThe beautiful, classy home has 2 double bedrooms and 2 bathrooms, master with ensuite and walk in robe. The open plan kitchen and living areas are very spacious and all have amazing views to the lagoons. The kitchen is divine and a chefs delight. So spacious it is fabulous for catering for your special events. The vaulted ceilings are a',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680583537_642bab71ca167.jpg',	'active',	0,	'no',	0,	24,	0,	NULL,	'2023-04-04 15:45:37',	'2023-06-24 11:05:51',	'Bellevue Ranch, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'115,000,000 vatu',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(24,	'Bellevue Rd 162114',	'bellevue-rd-162114',	1,	2,	55,	NULL,	NULL,	82000000.00,	'Beautiful Bellevue with secure Island living at it\'s best\r\nIt is our pleasure to list this beautiful home. The minute I set foot in the front door I was delighted to list this property. Enjoy the 180 degree panoramic views of the town, ocean and lagoons. On our hot Vanuatu days you will cherish the cooling breezes.\r\n\r\nThe home is of a high standard with quality fixtures and fittings throughout. The property is situated high up on the hill to make the most of the views and on a very generous land size of 3,003m2. The whole property is beautifully landscaped and laid to grass.\r\n\r\nRelax or enjoy entertaining on the undercover balcony and enjoy swimming in the sparkling clear infinity lap pool. For convenience a built in BBQ, sink, concrete pergola and built in table is at your disposal when having guests over. Listen to your favourite music through the outdoor speakers.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680584215_642bae1732dd3.jpg',	'active',	0,	'no',	0,	18,	0,	NULL,	'2023-04-04 15:56:55',	'2023-06-23 20:51:45',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	NULL,	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(25,	'LOCAL MANAGER',	'local-manager',	3,	10,	155,	NULL,	NULL,	NULL,	'GS Forex is opening a new office in Port Vila. Their company has an ambitious mission to make online trading accessible to anyone, anywhere and on their way to achieving this goal. With initial focus on Asia Pacific market, GS is looking to build its base in Vanuatu for serving various needs to the diverse client base in Asia Pacific region and more. You, as a local manager of GS Services Limited Vanuatu, will drive the creation and development of the Vanuatu office, including locating a suitable office space, setting up the office, recruiting a team of 3 to 5 employees in the first year, and onboarding and integrating that team into GS Forex’s global operation and customer support team. You will also need to take the lead when it comes to the project management of the work assigned to the Vanuatu team, HR management of the team, and ensuring compliance with corporate governance and laws in Vanuatu.',	'34577',	1,	1,	'farukrahman@gmail.com',	NULL,	'uploads/addss_image/1680584361_642baea97afac.png',	'active',	0,	'no',	0,	21,	0,	NULL,	'2023-04-04 15:59:21',	'2023-06-21 21:04:29',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'6',	'Masters / MBA',	500000,	60000,	'2023-04-17 00:00:00',	'joseb',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(26,	'Bellevue - ID: 236375',	'bellevue-id-236375',	1,	2,	56,	NULL,	NULL,	NULL,	'3\r\n2\r\nBELLEVUE HEIGHTS \"Wow Wow Wow\"\r\nOn entering the property via the automatic gate I thought I was in the “botanic gardens” and the first thought to my mind was WOW! The large land size of 6,750m2 is all laid to lawn, fully planted and beautifully landscaped, wow, a piece of Paradise. This is a rare opportunity to purchase such a large and beautiful property. Driving towards the house you have an area for guest parking and a double garage for personal parking.\r\nUpon entering the residence, there is another Wow! You will find a spacious open plan living, kitchen and dining room and then comes another Wow! The undercover entertaining area and a 10 meter in-ground infinity pool is amazing, then you have 180 degree panoramic views of the hills and valleys which are filled with lush green mature trees, palms, plants and flowers. My photography and video staff thought that he had died and gone to heaven as he was in such awe.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680584599_642baf9703f26.jpg',	'active',	0,	'no',	0,	22,	0,	NULL,	'2023-04-04 16:03:18',	'2023-06-24 07:55:14',	'Bellevue Ranch, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'sqft',	'Bellevue',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(27,	'MARKETING OFFICER – VIDEO PRODUCTION AND EDITOR',	'marketing-officer-video-production-and-editor',	3,	10,	146,	NULL,	NULL,	NULL,	'MARKETING OFFICER – VIDEO PRODUCTION AND EDITOR\r\n\r\nVodafone Vanuatu is seeking a Marketing Officer – Video Production and Editor to be based in Port Vila.\r\n\r\nMission:\r\nLead Video production and editor responsible for assembling recorded film, video footage and apply artistic editing techniques and creating a finished videos aligning with marketing plan.',	'6786',	1,	1,	'farukrahman@gmail.com',	NULL,	'uploads/addss_image/1680584661_642bafd51ee60.png',	'active',	0,	'no',	0,	35,	0,	NULL,	'2023-04-04 16:04:21',	'2023-06-24 13:36:10',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'321',	NULL,	37,	NULL,	'4',	'Masters / MBA',	34000,	45600,	'2023-04-18 00:00:00',	'seril',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(28,	'10 Rue Du Dauphine - ID: 143766',	'10-rue-du-dauphine-id-143766',	1,	2,	56,	NULL,	NULL,	71000000.00,	'Warehouse/Showroom and Home\r\nLocation, location, location!!!!!!\r\nThis property has it all!!!!\r\n\r\nMeticulously kept – 2 x Warehouses at 380m2, a showroom, an office and storage PLUS a Three bedroom home – all in excellent condition.\r\n\r\nIt is rare that I see a property kept and maintained so well.\r\n\r\nThis property has it all, the best of both worlds, you can work and live comfortably on the premises or accommodate for a manager to live on site.\r\n\r\nThe 3 bedroom, 2 bathroom solidly built home is located at the front of the property, fully fenced and secure. This home is in immaculate condition with separate laundry, large very well kept and maintained kitchen with separate eating area. The kitchen overlooking the lounge room. Large front and back gardens all fully fenced and separated from the commercial warehouses and showroom.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680584883_642bb0b34c839.jpg',	'active',	0,	'no',	0,	42,	0,	NULL,	'2023-04-04 16:08:03',	'2023-06-24 01:22:40',	'Port Vila International Airport (VLI), Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'Port Vila',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(29,	'VACANT POSITIONS WITH RAMADA RESORT',	'vacant-positions-with-ramada-resort',	3,	10,	155,	NULL,	NULL,	NULL,	'Ramada By Wyndham Port Vila (RBWPV) is seeking suitable candidates to appoint for the following position.\r\nThe main purpose of these positions is to assist the Executive Chef for planning, organizing, and managing food preparations.\r\n\r\n                                                            1. Demi chef \r\n\r\nReporting to the Sous Chef, assisting with preparation of different foods, from meats and sauces to vegetables and desserts. He/she also helps with the presentation and cooking, keeps the station up to federal, state and local health and safety standards, and sees that meals are prepared properly and in a timely manner.',	'6786',	1,	1,	'farukrahman@gmail.com',	NULL,	'uploads/addss_image/1680584982_642bb116e497c.jpg',	'active',	0,	'no',	0,	50,	0,	NULL,	'2023-04-04 16:09:42',	'2023-06-24 11:27:28',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'321',	NULL,	38,	NULL,	'2',	'Masters / MBA',	45000,	60000,	'2023-04-26 00:00:00',	'vikim',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(30,	'STUNNING BRAND NEW HOME Bellevue Stage Two ID: 145435',	'stunning-brand-new-home-bellevue-stage-two-id-145435',	1,	2,	56,	NULL,	NULL,	NULL,	'BRAND NEW FAMILY HOME WITH “WOW” FACTOR\r\nThis house is just gorgeous. Built to a very high standard with quality fixtures and fittings throughout. The minute I walked through the main door I was totally impressed after watching this build over the last few months.\r\n\r\nThe whole house definitely does have the “wow” factor. The beautiful floor tiles throughout are 60 x 60 size which gives the floors a look of luxury and seamlessness. All tiles have all been laid by one of Vanuatu’s best tilers.\r\nThe large open plan lounge, dining and kitchen is a entertainer’s delight complete with soft closing cupboards and doors with loads of cupboards and bench space equip with brand new cooking appliances.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680585372_642bb29c0c3b7.jpg',	'active',	0,	'no',	0,	19,	0,	NULL,	'2023-04-04 16:16:12',	'2023-06-24 11:38:12',	'Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'Port Vila, Vanuatu',	'total price',	NULL,	NULL,	NULL,	NULL,	5),
(31,	'Lot 50 Peacock Estate - ID: 171889',	'lot-50-peacock-estate-id-171889',	1,	2,	NULL,	NULL,	NULL,	59900000.00,	'BEST VIEWS IN PORT VILA!!!!\r\nBeautifully presented and maintained home on 1234 m2 of beautifully landscaped land.\r\n\r\nContemporary upgrades to this home have produced vibrant modern living spaces with stylish features flowing across a generous 4 bedroom design. The open plan living space boasts a high quality kitchen, casual, formal, indoor and outdoor living areas all with breath taking views of Fatumaru Bay, Port Vila Harbour, Iririki Island and Ifira Island.\r\n\r\nAll 4 bedrooms are of good proportion with the master bedroom offering a built-in robe and ensuite bathroom. Bedrooms 2 and 3 also have built-in robes and are serviced by a main bathroom with separate toilet. Bedroom 4 offering built in robes and ensuite bathroom.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680585825_642bb461da6e5.jpg',	'active',	0,	'no',	0,	15,	0,	NULL,	'2023-04-04 16:23:45',	'2023-06-06 12:02:36',	'Malapoa College, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'Malapoa',	'total price',	NULL,	NULL,	NULL,	NULL,	4),
(32,	'PROJECT COORDINATOR (CARE PARTNERSHIP)',	'project-coordinator-care-partnership',	3,	10,	146,	NULL,	NULL,	NULL,	'The Nasi Tuan Association (NTA) was founded on Tanna Island, Vanuatu, in 2009, and registered as a charitable society in July 2010. It has worked with, supported and established farmer cooperatives growing coffee, peanuts, vegetables and spices. As part of its long-term sustainability strategy, NTA established Tanna Garden Community Company (TGCC) with the main goal is to increase the quality of life and self-sufficiency of households including the most vulnerable groups in Tanna. The overall aim of Nasi Tuan Association is to address the underlying causes of the modern slavery on Tanna through awareness, raising and advocacy and to empower farm-based household to improve their income and quality of life.',	'45678',	1,	1,	'farukrahman@gmail.com',	NULL,	'uploads/addss_image/1680586036_642bb53455496.png',	'active',	0,	'no',	0,	29,	0,	NULL,	'2023-04-04 16:27:16',	'2023-06-21 18:28:43',	'Lenakel, Tanna',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'890',	NULL,	NULL,	NULL,	'9',	'Masters / MBA',	60000,	10000,	'2023-04-18 00:00:00',	'shihab',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
