(34,	'Lot 7 - ID: 168157',	'lot-7-id-168157',	1,	2,	54,	NULL,	NULL,	59000000.00,	'Oceanfront Island Paradise\r\nImmaculately presented, this gorgeous fully self-sufficient property is on the market and ready for new owners.\r\nWhether you are looking for the perfect Island paradise escape or a fantastic investment then Lot 7 is for you.\r\nSet on 4,852 square meters of oceanfront land and in the middle of forest parkland it certainly does tick a lot of boxes.\r\nThe property consists of a very large master bedroom with walk in wardrobe and bathroom, lined with aluminum louvre windows maximizing the ocean breeze and view. The second bedroom is also large with its own bathroom. The main hub of the home is designed open plan with kitchen, living and dining all with an ocean view.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680586543_642bb72f56db4.jpg',	'active',	0,	'no',	0,	16,	0,	NULL,	'2023-04-04 16:35:43',	'2023-06-05 16:06:25',	'Eton Reef Private Resort, Efate, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'Eton Reef',	'total price',	NULL,	NULL,	NULL,	NULL,	2),
(35,	'LOCAL SALES ASSISTANT AND MERCHANDISING OFFICER',	'local-sales-assistant-and-merchandising-officer',	3,	10,	146,	NULL,	NULL,	NULL,	'Esah corporation Ltd is looking for energetic, honest & responsible people to join our team:\r\n\r\nLocal sales assistant and merchandiser – position in Vila office is open to all interested individuals.\r\n\r\nMinimum 3 years experience in merchandising & or sales.\r\nPrefer applicant with experience deal with hotel/ resort or restaurant will be an advantage.\r\nAble to efficiently communicate in english and bislama.\r\nPosses computer skills specifically excel and word.\r\nPosses drivers license.\r\nAn effective and pleasant communicator.',	'35567',	1,	1,	'farukrahman@gmail.com',	NULL,	'uploads/addss_image/1680586791_642bb8274d681.jpg',	'active',	0,	'no',	0,	65,	0,	NULL,	'2023-04-04 16:39:51',	'2023-06-22 17:39:26',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'234',	NULL,	40,	NULL,	'6',	'Masters / MBA',	800000,	100000,	'2023-04-17 00:00:00',	'abar',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(36,	'0 Malapoa - ID: 130764',	'0-malapoa-id-130764',	1,	2,	NULL,	NULL,	NULL,	50000000.00,	'PRICED TO SELL, ENTERTAINERS DREAM\r\nPRICED TO SELL, ENTERTAINERS DREAM, ROOM TO EXPAND/BUILD\r\n\r\nSplit over two blocks facing Mele Bay with gorgeous views, the possibilities are endless at this property.\r\n\r\nThis property offers:\r\n\r\nAn elevated three bedroom home plus study, large open plan lounge room opening up to a great outdoor area with gorgeous water views.\r\nThe property is complete with high ceilings and well-proportioned rooms, you will feel at home the minute you walk in.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680586996_642bb8f485b95.jpg',	'active',	0,	'no',	0,	21,	0,	NULL,	'2023-04-04 16:43:16',	'2023-06-24 03:41:21',	'GREAT PRICE',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'GREAT PRICE',	'total price',	NULL,	NULL,	NULL,	NULL,	3),
(37,	'Waterfront Quays Apartment - ID: 129759',	'waterfront-quays-apartment-id-129759',	1,	2,	54,	NULL,	NULL,	50000000.00,	'Luxury Waterfront Quays Apt @ VT50Million\r\nThis beautiful apartment is in the perfect location in the center of Port Vila, walking distance to nearly all bars, restaurants and shops.\r\n\r\nImagine overlooking the beautiful Harbor and watching the yachts and boats come and go while sipping on your favorite tipple.\r\n\r\nThis apartment comes fully furnished so move in and have absolutely nothing to do except ENJOY.\r\n\r\nFEATURES:\r\n\r\nGourmet Kitchen\r\nOpen Plan Lounge and Dining\r\n3 x Bedrooms\r\n2 x Bathrooms\r\nFully equipped Laundry\r\nAir conditioning system\r\n1 x Car Space',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680587270_642bba062d659.jpg',	'active',	0,	'no',	0,	18,	0,	NULL,	'2023-04-04 16:47:50',	'2023-06-11 07:29:17',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'EFATE',	'total price',	NULL,	NULL,	NULL,	NULL,	3),
(38,	'Kumul High Way - ID: 233198',	'kumul-high-way-id-233198',	1,	2,	NULL,	NULL,	NULL,	95000000.00,	'OWN YOUR OWN BUSINESS AND LIVE ON SITE\r\nExclusive to LJ Hooker. This opportunity doesn’t come along very often. On sale we are happy to present one of Port Vilas best Thai restaurants, including a spa where they do therapeutic and relaxing massages. One of my favorite places to go in Vila. I would love a great chef to keep this momentum going as it is a very popular restaurant loved by all. The staff already in place are very good and attentive to all the clients. The views over Port Vila are amazing and the sunsets each night are stunning',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680587531_642bbb0b8309c.jpg',	'active',	0,	'no',	0,	15,	0,	NULL,	'2023-04-04 16:52:11',	'2023-06-06 12:44:59',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	NULL,	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(39,	'Numbatri - ID: 84997',	'numbatri-id-84997',	1,	2,	54,	NULL,	NULL,	90000000.00,	'Numbatri VUV 90,000,000\r\nExclusive to LJ Hooker. Situated at Numbatri, this property is a rare find as there is not much available for sale on the main highway these days. The land size is a generous1,996 m2 and it does back on to the Le Lagon golf course. The large solidly built open plan showroom is approximately 300m2 and is currently rented out to 2 tenants. Just a great retail space.\r\n\r\nBehind the showroom is a solidly built 4 bedroom family home with 2 bathrooms (master with ensuite) plus a 1 bedroom apartment. There is also a separate room which is set up as a second kitchen. Great idea for catering for large quantities of food and special occasions. Complete with a large garage, landscaped and planted throughout.\r\n\r\nWell worth a viewing as this is a tightly held area and won\'t last long on the market.\r\n\r\nPlease let us know if you have further queries or would like to make an appointment for a viewing.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680587931_642bbc9b662ba.jpg',	'active',	0,	'no',	0,	22,	0,	NULL,	'2023-04-04 16:58:51',	'2023-06-24 13:28:55',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	NULL,	'total price',	NULL,	NULL,	NULL,	NULL,	4),
(40,	'Bellevue Rd - ID: 162114',	'bellevue-rd-id-162114',	1,	2,	54,	NULL,	NULL,	82000000.00,	'Beautiful Bellevue with secure Island living at it\'s best\r\nIt is our pleasure to list this beautiful home. The minute I set foot in the front door I was delighted to list this property. Enjoy the 180 degree panoramic views of the town, ocean and lagoons. On our hot Vanuatu days you will cherish the cooling breezes.\r\n\r\nThe home is of a high standard with quality fixtures and fittings throughout. The property is situated high up on the hill to make the most of the views and on a very generous land size of 3,003m2. The whole property is beautifully landscaped and laid to grass.\r\n\r\nRelax or enjoy entertaining on the undercover balcony and enjoy swimming in the sparkling clear infinity lap pool. For convenience a built in BBQ, sink, concrete pergola and built in table is at your disposal when having guests over. Listen to your favourite music through the outdoor speakers.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680588249_642bbdd924156.jpg',	'active',	0,	'no',	0,	19,	0,	NULL,	'2023-04-04 17:04:09',	'2023-06-16 04:14:59',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'EFATE',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(41,	'TRAVELLER\'S BUDGET MOTEL - ID: 129725',	'travellers-budget-motel-id-129725',	1,	2,	55,	NULL,	NULL,	77000000.00,	'MOTEL FOR SALEPORT VILA VANUATU\r\nThe Traveller\'s Budget Motel - Port Vila\'s Best Value Budget Accommodation.\r\n\r\nSpotless budget accommodation ten minutes from the airport, Easy 8-10 Minute stroll to the Centre of Port Vila.\r\n\r\n10 rooms has its own bathroom, kitchenette, microwave, bar fridge, TV and work desk. All rooms have cold room-controlled air-conditioning and ceiling fans.\r\n\r\nLarge Dormitory with 10 Beds own bathroom, kitchenette, microwave, bar fridge, TV and work desk. All rooms have cold room-controlled air-conditioning and ceiling fans.\r\n\r\nAn outside faré (far-ray) with full communal kitchen and BBQ facilities overlooks an 8.5 metre pool and provides a tranquil place to sit and read.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680588664_642bbf78de3d1.jpg',	'active',	0,	'no',	0,	19,	0,	NULL,	'2023-04-04 17:11:04',	'2023-06-05 16:40:19',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'sqft',	'EFATE',	'total price',	NULL,	NULL,	NULL,	NULL,	10),
(42,	'A GREAT OPPORTUNITY TO SUPPORT LABOUR MOBILITY WORKERS BEFORE THEY LEAVE TO TRAVEL OVERSEAS, AND WHILST THEY ARE LIVING AND WORKING IN AUSTRALIA AND NEW ZEALAND. COME AND JOIN THE LABOUR MOBILITY TEAM AT THE DPT LABOUR',	'a-great-opportunity-to-support-labour-mobility-workers-before-they-leave-to-travel-overseas-and-whilst-they-are-living-and-working-in-australia-and-new-zealand-come-and-join-the-labour-mobility-team-at-the-dpt-labour',	3,	10,	155,	NULL,	NULL,	NULL,	'The Labour Mobility Officer – Worker Welfare will coordinate with the Country Liaison Officer (CLO) roles, to provide specialised welfare support and advice to workers and their families who are participating in labour mobility programs in Australia and New Zealand. This officer will work closely with the CLO based in Australia & New Zealand, the Australian Government Department of Employment & Workplace Relations (DEWR), Approved Employers in Australia and New Zealand, and others who are part of the ‘community care model’; to coordinate and monitor Ni-Vanuatu workers’ welfare.',	'987700',	1,	1,	'farukrahman@gmail.com',	NULL,	'uploads/addss_image/1680588892_642bc05c4d02f.png',	'active',	0,	'no',	0,	21,	0,	NULL,	'2023-04-04 17:14:52',	'2023-06-21 17:18:17',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'435',	NULL,	43,	NULL,	'6',	'Masters / MBA',	700000,	100000,	'2023-04-17 00:00:00',	'sakib',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(43,	'Havannah Harbour - ID: 222653',	'havannah-harbour-id-222653',	1,	2,	54,	NULL,	NULL,	59000000.00,	'WOW...75METERS OF BEACH FRONT\r\nThis is a fabulous opportunity and a blue chip investment not to miss out on. On offer for sale we have 2 adjacent blocks, 2 titles, of land at beautiful Havannah Harbour. Together they measure a massive 75 meters of absolute beach / water frontage and 4,941 sqm of land. Most blocks are only around 30 meters of beachfront. Havannah Harbour is renowned for its deep, calm and crystal clear waters and beautiful white sandy beaches. The perfect location for all water sports, fishing, diving and snorkeling. The under water fish and coral life is so spectacular you will addicted to diving and snorkeling in no time. This is all on your doorstep. Enjoy swimming all year round as whether the tides are low or high you can still enjoy frolicking around in the water. You can even moor your boat out the front. These blocks are zoned residential but can be',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680588962_642bc0a22c73f.jpg',	'active',	0,	'no',	0,	20,	0,	NULL,	'2023-04-04 17:16:02',	'2023-06-21 18:15:39',	'North Efare',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	NULL,	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(44,	'Harbour view Rd - ID: 129762',	'harbour-view-rd-id-129762',	1,	2,	54,	NULL,	NULL,	49000000.00,	'FABULOUS LOCATION WITH AMAZING VIEWS\r\nFor sale this meticulously renovated home is now on the market for sale. Its unique design and chosen colour pallets are a real feature throughout. This 2 level house can be used as 2 separate dwellings or as one large home. It would be a fantastic home with an office or business operating from the ground floor apartment. Both levels have full kitchens, each have 2 bedrooms and 2 bathrooms. The living areas are very spacious and open plan. Alternatively live on one level and rent the other level out for some well needed income.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680589268_642bc1d41d67b.jpg',	'active',	0,	'no',	0,	24,	0,	NULL,	'2023-04-04 17:21:08',	'2023-06-18 04:52:29',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'EFATE',	'total price',	NULL,	NULL,	NULL,	NULL,	4),
(45,	'A GREAT OPPORTUNITY FOR A PASSIONATE PERSON WITH MEDIA AND COMMUNICATIONS SKILLS. COME AND JOIN THE LABOUR MOBILITY TEAM, AT THE DPT LABOUR AND USE YOUR SKILLS TO MAKE A DIFFERENCE TO PEOPLE’S LIVES”',	'a-great-opportunity-for-a-passionate-person-with-media-and-communications-skills-come-and-join-the-labour-mobility-team-at-the-dpt-labour-and-use-your-skills-to-make-a-difference-to-peoples-lives',	3,	10,	155,	NULL,	NULL,	NULL,	'The Labour Mobility Communications Officer will be responsible for coordinating national media of Labour Mobility in Vanuatu, through media and promotional outlets, including television, radio, print press and social media, in particular ‘Dpt Labour’s Labour Mobility’ Facebook page. This role will also support regional media initiatives and contribute to the development of monitoring and evaluation communication products.\r\n\r\nThe Employment Services Unit (ESU) within the Dpt of Labour is responsible for delivering a high-quality Labour Mobility program to both Australia and New Zealand. Part of quality programming is to ensure that the labour mobility information shared with workers, with employers, with labour mobility stakeholders, and with the public is accurate and timely.',	'09988',	1,	1,	'farukrahman@gmail.com',	NULL,	'uploads/addss_image/1680589375_642bc23ff3dee.png',	'active',	0,	'no',	0,	24,	0,	NULL,	'2023-04-04 17:22:55',	'2023-06-21 18:00:11',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'908',	NULL,	NULL,	NULL,	'4',	'Masters / MBA',	65000,	80000,	'2023-04-18 00:00:00',	'abir',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
