(67,	'Teouma Bay - ID: 129733',	'teouma-bay-id-129733',	1,	2,	54,	NULL,	NULL,	10650000.00,	'Gorgeous Waterfront Vacant Land ...NOTHING LEFT TO DO BUT BUILD\r\nIf you are looking for an affordable and large piece of paradise with waterfrontage, we have it...\r\n\r\nFour blocks for sale, located in the beautifully protected bay of Teouma, along the East Coast of Efate. Block sizes ranging from 1968m2 to 2040m2 , each with 35m of waterfrontage.\r\n\r\nWaterfront providing the perfect launch for JetSki\'s, Stand up paddle boards and kayaks as well as providing amazing snorkelling along the coral heads all right on your doorstep\r\n\r\nEach Block has:\r\n Individual 35m of private beach\r\n All utilities connected\r\n All approvals and regulatory requirements in place\r\n Cleared and level land\r\n Sunset views\r\n\r\nNOTHING LEFT TO DO BUT BUILD\r\n\r\nClose to beautiful eateries \'Tamanu on the Beach\' and \'Ripples on the bay\' and only 15 minutes from Port Vila.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680599829_642beb15a0147.jpg',	'active',	0,	'no',	0,	17,	0,	NULL,	'2023-04-04 20:17:09',	'2023-06-17 15:32:30',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'sqft',	'EFATE',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
