(69,	'0 Aore Island - ID: 129717',	'0-aore-island-id-129717',	1,	2,	54,	NULL,	NULL,	NULL,	'HOT BUY - Absolute white sandy beach and clear crystal waters\r\n2 Adjacent blocks reduced for a quick sale for VUV 10,000,000 each!\r\nBuy both lots and have nearly 60 metres of absolute pristine waterfront with your own un-spoilt white sandy beach. Land size in total is 2,278 m2\r\n\r\nThis is a definite must see if you are looking for a slice of Paradise to build your dream home on. If first impressions count, then your first glimpse of Lapita Plantation on Aore Island Santo will blow you away. Nestled invitingly on the western end of Aore Island you will know immediately you have arrived somewhere very special. Lapita is located on one of the most beautiful tropical coastlines in the South Pacific. Surrounded by aquamarine waters with some 700 acres of lush green coconut plantation wi',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680600345_642bed19bb077.jpg',	'active',	1,	'yes',	0,	23,	0,	NULL,	'2023-04-04 20:25:45',	'2023-06-22 07:23:22',	'Santo-Pekoa International Airport, Luganville, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'SANTO',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(70,	'Multiple lots UNDINE BAY - ID: 85022',	'multiple-lots-undine-bay-id-85022',	1,	2,	54,	NULL,	NULL,	NULL,	'FOR BOAT ENTHUSIASTS\r\n11,000,000 vatu -to 27,000,000 vatu\r\n\r\nUndine Bay Marina Estate Lots 1-33, Port Vila Vanuatu\r\n\r\nOn sale are absolute waterfront and canal sections of land. Undine Bay Marina Estate has stunning sections which are located in and around the purpose built marina development and comprise of 13 Foreshore Lots and 20 Canal Lots.\r\n\r\nUndine Bay Marina Estate is a foreshore and waterways residential development situated at Undine Bay on the North shores of the main island of Efate in Vanuatu. It is an easy 35-40 minute drive from the airport at Port Vila on a tar sealed road.\r\n\r\nEach of the 13 Foreshore Lots face north with a minimum 30m ocean frontage giving private access to the beautiful white sandy beach and incredible views of the whole of Undine Bay.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680600649_642bee49a41e4.jpg',	'active',	1,	'yes',	0,	39,	0,	NULL,	'2023-04-04 20:30:49',	'2023-06-23 08:07:22',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'EFATE',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
