(77,	'HAVANNAH NAH NAH NAH HAVANNAH',	'havannah-nah-nah-nah-havannah',	1,	2,	54,	NULL,	NULL,	34137152.00,	'Offered at 425,000 AUD ONO, this is one of the largest private waterfront lots at exclusive Havannah Harbour! Location, location + 4,545m2 of nearly flat land gently sloping to 31m of private beach, just properly cleared and ready to build. The aspects and views are perfect, including early sunrise poking over the gorgeous forest hills at dawn to the right, stunning sunsets over the islands of Lelepa and Moso to the left, views of distant Hat Island to the South and the gorgeous and tranquil Havannah Harbour right in front to the North. Deep water access for any vessel and secure mooring site. Havannah Harbour is a water sports heaven, from swimming and snorkelling to SUP, diving, jet and water skiing. Game fishing charters operate from the area catching martin, tuna and other fabulous fish, and when it\'s time to eat and drink, several restaurants and bars of any standard are just a stroll or short boat ride away. If you enjoy a good lifestyle, this block will not be missed!',	'678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680603404_642bf90cbf875.jpg',	'active',	0,	'no',	0,	12,	0,	NULL,	'2023-04-04 21:16:44',	'2023-06-07 17:49:59',	'SAM LEWIS',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'HAVANNAH NAH NAH NAH',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
