(133,	'IDEAL RESORT SITE',	'ideal-resort-site',	1,	2,	61,	NULL,	NULL,	78108144.00,	'Resort site for sale Aore Island. Perfect white sand beach. 8 Coconut Drive Lapita Beach Aore Island Vanuatu is one of the last two approved resort sites for sale on Aore Island. This is a once-in-a-lifetime opportunity to build your dream resort. The site is an approved commercial/Tourism allowing you to buy and start to build without all the headaches of getting government approval.\r\n\r\nOne hundred twenty-four meters of perfect white sand beach fringed with aquamarine waters. Perfect for swimming, snorkelling or just about any water sport.\r\n\r\nThe site is mostly clear and ready for construction as it is currently part of Lapita Plantation. It slopes up gently from the salt water, allowing your guest to take full advantage of the view and spectacular sunsets.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680681307_642d295b9cf20.jpg',	'active',	1,	'yes',	0,	18,	0,	NULL,	'2023-04-05 18:55:07',	'2023-06-19 12:46:32',	'Aore Island Resort, Luganville, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'AORE',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(134,	'SUNSET BUNGALOWS',	'sunset-bungalows',	1,	2,	61,	NULL,	NULL,	317162592.00,	'Are you are looking for a good investment opportunity? Look no further than Sunset Bungalows! Located right on the edge of the 2nd Lagoon, a true tropical escape. Comes with a spectacular view and of the lagoon and a sunset view to die for. All the bungalows come fully furnished as well as the restaurant and the pool area.',	'+678 779 9252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680681603_642d2a83089e9.jpg',	'active',	0,	'no',	0,	15,	0,	NULL,	'2023-04-05 19:00:03',	'2023-06-06 05:22:25',	'SECOND LAGOON',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'SECOND LAGOON',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(135,	'QUEST APPARTMENTS',	'quest-appartments',	1,	2,	61,	NULL,	NULL,	10379904000.00,	'The sale is for a multi-unit complex (formerly an accommodation business) with an adjoining block of land. There are three separate accommodation buildings, and each building is home to the following:\r\n\r\n- 2 x 1 bedroom apartments\r\n\r\n- 1 x studio apartment\r\n\r\n- 1 x 2 bedroom apartment\r\n\r\nMaking this a total offering of 15 dwellings, all with plenty of on-site parking.\r\n\r\nIn addition to the apartments, the property has a swimming pool, children\'s play area and nakamal.\r\n\r\nFormerly run as \'Quest Apartments\', and located in very secure grounds with a large carpark, you could continue to run this business as an accommodation centre or short-term rental accommodation or even further develop using the adjoining land and developing into something more.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680681813_642d2b553e54a.jpg',	'active',	1,	'yes',	0,	16,	0,	NULL,	'2023-04-05 19:03:33',	'2023-06-19 23:55:55',	'TASSIRIKI',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'TASSIRIKI',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(138,	'TROPICANA RESORT',	'tropicana-resort',	1,	2,	61,	NULL,	NULL,	287036384.00,	'BOUTIQUE RESORT FOR SALE\r\nTropicana Resort is conveniently located within walking distance of a supermarket, Port Vila International School (PVIS), the University of South Pacific (USP), and the Korman Sports precinct used for VAN17 Pacific Mini Games. Port Vila downtown is a short 5 min bus ride away.\r\n\r\nThe 18 self-contained apartments are in two concrete buildings and tastefully furnished with quality interiors. Ample parking, a swimming pool, a private beach, and an over-water restaurant for up to 40 guests provide all the resort facilities guests wish for but without the crowds of the larger resort chains. Tropicana caters to both holiday guests and short/long-term corporate guests.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680683285_642d3115531cc.jpg',	'active',	1,	'yes',	0,	19,	0,	NULL,	'2023-04-05 19:28:05',	'2023-06-16 11:33:06',	'SECOND LAGOON',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'SECOND LAGOON',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(139,	'Recrutement d’un Chauffeur',	'recrutement-dun-chauffeur',	4,	10,	348,	NULL,	NULL,	NULL,	'Préparer et contrôler les commandes à livrer ou au wharf et faire valider par le Chef d\'atelier,\r\n• Procéder au chargement des marchandises sur le véhicule de livraison manuellement ou à l\'aide du matériel de manutention mis à sa disposition (pont roulant, chariot élévateur), et s\'assurer que le chargement soit optimisé (n\'excédant pas la charge utile du camion, et volume pas trop faible non plus pour rentabiliser la livraison).',	'0888',	1,	1,	'hasib@gmail.com',	NULL,	NULL,	'active',	0,	'no',	0,	21,	0,	NULL,	'2023-04-05 19:37:37',	'2023-06-20 15:58:01',	'Port Vila',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'989',	NULL,	NULL,	NULL,	'2',	'Masters / MBA',	400000,	600000,	'2023-04-28 00:00:00',	'RASHED',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL),
