(141,	'LAGOON VILLAS',	'lagoon-villas',	1,	2,	61,	NULL,	NULL,	5898104832.00,	'Lagoon Villas\r\nAn investor\'s dream!\r\n\r\nFor sale are 4 villas located opposite the new VAN17 Pacific Mini Games sporting complex and only a short walk to ABM supermarket, the University of South Pacific, food markets, several waterfront restaurants, and Port Vila International School.\r\n\r\nThere are 2 x 2 bedrooms offering 106m2 of living and 2 x 3 bedroom villas offering 116m2 of living. Each villa comes with its own plunge pool and low-maintenance yard. Each villa is separately fenced and includes a modern interior, washing machine, a/c, satellite TV, internet ready, and own car park. Each villa is ready to move in should you wish or be tenanted for the investor buyer.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680684107_642d344bb74d3.jpg',	'active',	1,	'yes',	0,	14,	0,	NULL,	'2023-04-05 19:41:47',	'2023-06-06 01:49:17',	'SECOND LAGOON',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'SECOND LAGOON',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(142,	'PRINCIPAL CUSTOMS BROKER',	'principal-customs-broker',	4,	10,	348,	NULL,	NULL,	NULL,	'We have a vacancy in our company for an experienced Principal Customs Broker. The ideal candidate will have a minimum 5 years’ experience processing customs clearances in ASYCUDA. A current Principal Broker Licence from Vanuatu Customs is essential. Mature, responsible, reliable, honest and hardworking are understandable requirements.',	'098',	1,	1,	'hasib@gmail.com',	NULL,	NULL,	'active',	0,	'no',	0,	19,	0,	NULL,	'2023-04-05 19:46:31',	'2023-06-16 13:26:03',	'Port Vila, Efate',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'098',	NULL,	NULL,	NULL,	'2',	'Masters / MBA',	400000,	500000,	'2023-04-26 00:00:00',	'jiullur',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(143,	'COCO BEACH',	'coco-beach',	1,	2,	61,	NULL,	NULL,	235136752.00,	'BEACH RESORT FOR SALE\r\nBEACH RESORT FOR SALE\r\n\r\nWelcome to Coco Beach Vanuatu!\r\n\r\nSituated on a beautiful private white sandy beach with crystal clear waters, Coco Beach Resort offers 15 luxurious farés, fabulous dining right on the water, great swimming and snorkelling, surrounded by stunning scenery and amazing year-round sunsets.\r\n\r\nThis family-owned resort is located 15 minutes from Port Vila town centre and 25 minutes from Port Vila International Airport. But why drive there when you can arrive by boat? With a dedicated channel allowing for deep water access, this resort is one of a kind and is popular with cruise ship day visitors. The 15 bungalows include four beachfront, five ocean views and six garden views on 5,748m2 of tropical landscaped grounds. The bungalows are tastefully appointed and are built with light concrete panels and natural Natangura roofs',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680684421_642d358525631.jpg',	'active',	1,	'yes',	0,	18,	0,	NULL,	'2023-04-05 19:47:01',	'2023-06-12 04:09:29',	'Paradise Cove Resort, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'sqft',	'PARADISE COVE',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(144,	'1 TRAVELLERS BUDGET MOTEL',	'1-travellers-budget-motel',	1,	2,	61,	NULL,	NULL,	3984.00,	'The Traveller\'s Budget Motel - Port Vila\'s Best Value Budget Accommodation\r\n\r\nSpotless budget accommodation ten minutes from the airport, Easy 8-10 Minute stroll to the Centre of Port Vila.\r\n\r\n10 rooms have their bathroom, kitchenette, microwave, bar fridge, TV and work desk. All rooms have cold room-controlled air-conditioning and ceiling fans.\r\n\r\nLarge Dormitory with 10 Beds, own bathroom, kitchenette, microwave, bar fridge, TV and work desk. All rooms have cold room-controlled air-conditioning and ceiling fans.\r\n\r\nAn outside faré with full communal kitchen and BBQ facilities overlooks an 8.5-metre pool and provides a tranquil place to sit and read.',	'+678 7799252',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1680684643_642d3663f081e.jpg',	'active',	1,	'yes',	0,	17,	0,	NULL,	'2023-04-05 19:50:43',	'2023-06-07 05:14:31',	'Hotel Santo, Luganville, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'sqft',	'Hotel',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(145,	'Human Resource Officer',	'human-resource-officer',	4,	10,	343,	NULL,	NULL,	NULL,	'The Holiday Inn Hotels & Resort brand belongs to the IHG® family of brands - a successful, global hospitality company with over 5,600 hotels and resorts in over 100 countries around the world. At Holiday Inn Resort Vanuatu our job is to bring the joy of travel to everyone. That\'s where you come in! We\'re looking for people who are friendly, welcoming and full of life; people who are always finding ways to make every guest\'s experience an enjoyable one. When you\'re part of the Holiday Inn Resort Vanuatu you\'re more than just a job title.',	'09876',	1,	1,	'hasib@gmail.com',	NULL,	NULL,	'active',	0,	'no',	0,	25,	0,	NULL,	'2023-04-05 19:57:35',	'2023-06-21 22:11:54',	'Port Vila',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'076',	NULL,	85,	NULL,	'3',	'Masters / MBA',	280000,	40000,	'2023-04-18 00:00:00',	'DASU',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
(146,	'PAVILLION STYLE VILLAS',	'pavillion-style-villas',	1,	2,	55,	NULL,	NULL,	91669392.00,	'Are you ready for the ultimate seafront experience? Look no further! This unique property is an absolute gem - it\'s cyclone-proof, breathtakingly beautiful, and boasts nearly 3 acres of professionally landscaped park-like gardens. With 85 meters of ocean frontage, this property is a true paradise.\r\n\r\nThe best part? The property has been meticulously renovated from roof to floor by an Engineer and an Interior Designer. No detail has been overlooked! And let\'s talk about the materials - this place has been built to last with concrete and hardwood. The result? A stunning masterpiece that will make you the envy of all your friends and family.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680686018_642d3bc27cdab.jpg',	'active',	1,	'yes',	0,	15,	0,	NULL,	'2023-04-05 20:13:38',	'2023-06-06 08:38:58',	'Narpow Point Heights Subdivision, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'NARPOW POINT',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(147,	'HAVANNAH NAH NAH NAH',	'havannah-nah-nah-nah',	1,	2,	54,	NULL,	NULL,	33861796.00,	'Offered at 425,000 AUD ONO, this is one of the largest private waterfront lots at exclusive Havannah Harbour! Location, location + 4,545m2 of nearly flat land gently sloping to 31m of private beach, just properly cleared and ready to build. The aspects and views are perfect, including early sunrise poking over the gorgeous forest hills at dawn to the right, stunning sunsets over the islands of Lelepa and Moso to the left, views of distant Hat Island to the South and the gorgeous and tranquil Havannah Harbour right in front to the North. Deep water access for any vessel and secure mooring site. Havannah Harbour is a water sports heaven, from swimming and snorkelling to SUP, diving, jet and water skiing. Game fishing charters operate from the area catching martin, tuna and other fabulous fish, and when it\'s time to eat and drink, several restaurants and bars of any standard are just a stroll or short boat ride away. If you enjoy a good lifestyle, this block will not be missed!',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680686218_642d3c8a755da.jpg',	'active',	1,	'yes',	0,	18,	0,	NULL,	'2023-04-05 20:16:58',	'2023-06-21 21:31:06',	'The Havannah Vanuatu, Port Havannah, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'HAVANNAH',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(148,	'MOUNTAIN RANCH',	'mountain-ranch',	1,	2,	54,	NULL,	NULL,	55781616.00,	'Hey there, tired of the rat race and craving a tropical escape? Look no further than this slice of paradise in Vanuatu!\r\n\r\nSpread across a whopping 3.8 hectares, this property is bursting with mature trees, and tropical flowers, and even has its own chicken coop for fresh eggs every morning. Plus, the fertile land means you can grow your own organic produce - say goodbye to supermarket veggies with no taste!\r\n\r\nAfter a long day of lounging by the pool and soaking up the sun, head to the massive shed to tinker with your tools, including a tractor and slasher. And when it\'s time to relax, the high-ceilinged house boasts 4 spacious bedrooms and 3 bathrooms, complete with a large kitchen and pantry for cooking up a storm.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680686347_642d3d0b96307.jpg',	'active',	1,	'yes',	0,	13,	0,	NULL,	'2023-04-05 20:19:07',	'2023-06-07 18:55:03',	'TAMATE',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'TAMATE',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
