(150,	'EPI-TOME OF WATERFRONT PROPERTY!',	'epi-tome-of-waterfront-property',	1,	2,	54,	NULL,	NULL,	134973296.00,	'Get ready to make waves in the world of real estate with this Epi-tome of waterfront property! This 13-acre slice of paradise boasts a whopping 770 meters of ocean frontage and is spread across not one, not two, but SEVEN separate commercial titles, each with its very own waterfront view. If you\'re looking for a place to call your own, this property will have you feeling like you\'re on top of the world!\r\n\r\nBut wait, there\'s more! This property comes complete with a 338 sq m, 7-bedroom, 4-bathroom, 2-story hardwood timber/iron roof house, perfect for hosting all of your closest friends and family (or, let\'s be real, turning into a party palace). And if that\'s not enough space for you, there\'s also a 220 sq m, 1-bedroom, 1-bathroom, single-story concrete block/iron roof cabin with a full-sized kitchen and huge verandah that\'s just begging for a lazy Sunday afternoon spent lounging around.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680686507_642d3dab7b88e.jpg',	'active',	0,	'no',	0,	21,	0,	NULL,	'2023-04-05 20:21:47',	'2023-06-18 10:56:52',	'Epi High School, Vaemali, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'EPI',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
