(152,	'LARGE FAMILY HOME + POOL',	'large-family-home-pool',	1,	2,	55,	NULL,	NULL,	45238888.00,	'This spacious 4-bedroom, 3-bathroom home sits at the end of a \"no-through road\" in Nambatri, offering privacy and tranquil views of the adjoining hotel golf course. The property is securely enclosed within a 2,314 m2 site, with concrete and mesh wire fencing and two new electric gates. The land is elevated in some areas, making it an ideal spot to build a second home or duplex with private access for rental income or additional family housing.\r\n\r\nThe main house has terraces on both sides, a small private terrace outside the main bedroom, and a wooden enclosed deck surrounding the pool and outdoor dining area. The bespoke kitchen by a renowned Vanuatu cabinet maker highlights the open-plan living and dining area. All windows have built-in security bars and an outdoor kitchen and toilet. For those who love fresh produce, a variety of local fruit and vegetable plants can be expanded upon.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680686835_642d3ef3a63e6.jpg',	'active',	1,	'yes',	0,	19,	0,	NULL,	'2023-04-05 20:27:15',	'2023-06-24 03:23:02',	'Nambatri Shopping Centre, Nambatri, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'NAMBATRI',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(153,	'LARGE BLOCK',	'large-block',	1,	2,	54,	NULL,	NULL,	15818688.00,	'Don\'t miss this incredible opportunity to invest in one of Vanuatu\'s most exquisite locations with this amazing vacant land for sale!\r\n\r\nComprising of two land leases for the price of one, this property is a real gem. The first lease is a residential waterfront block, offering a total of 3913sqm with a breathtaking 40m of absolute beach frontage. The second lease is a commercial roadblock, boasting a total area of 6085 sqm.\r\n\r\nNot only does this property offer size and stunning waterfront views, but it is also easily accessible via a sealed road, with mains power and water via a bore. The location is perfect for those who seek tropical island living with lush green surroundings, untouched and clean, and ready for you to build on now.\r\n\r\nDon\'t let this opportunity pass you by. Contact us today to learn more and to arrange a viewing of this spectacular property',	'+678 779 9252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680687068_642d3fdcbbbb9.jpg',	'active',	1,	'yes',	0,	15,	0,	NULL,	'2023-04-05 20:31:08',	'2023-06-07 11:54:52',	'UNDINE BAY',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	'10000',	'sqft',	'UNDINE BAY',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(154,	'YOUR NEW HOUSE ON THE LAGOON',	'your-new-house-on-the-lagoon',	1,	2,	55,	NULL,	NULL,	44146052.00,	'Spacious 3 bedroom, 2 bathroom house available for rent in Tassiriki area.\r\n\r\nLocation:\r\nJust a stone throw away from PVIS school & down a quiet cul de sac street on the Tassiriki lagoon.\r\n\r\n9 Features:\r\n- Very large and spacious home within secure yard & electric gate.\r\n- High ceilings, which allow for great ventilation and loads of natural light\r\n- 3 Bedrooms with in built wardrobes\r\n- 2 Bathrooms with toilet & shower and in built shelves\r\n- Spacious open plan living/dining area with dining table and couch\r\n- Large covered terrace for outdoor living - a must in our tropical climate\r\n- Beautiful and spacious garden that gives onto the first lagoon (steps into the water) with a gorgeous selection of fruit and shady trees',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680687548_642d41bc6bf88.jpg',	'active',	1,	'yes',	0,	24,	0,	NULL,	'2023-04-05 20:39:08',	'2023-06-24 11:18:15',	'TASSIRIKI',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'TASSIRIKI',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(155,	'STYLISH HOME IN TOWN',	'stylish-home-in-town',	1,	2,	55,	NULL,	NULL,	39370664.00,	'LOCATION, LOCATION, LOCATION\r\nLOCATION, LOCATION, LOCATION\r\n\r\n\r\nWant to be in the centre of town? This is a must-see.\r\nUpstairs is the primary residence with two bedrooms and two bathrooms. You will also enjoy spectacular harbour views from the balcony and raked high ceilings with exposed timber beams—a truly stunning feature in this island home.\r\nDownstairs is an entirely separate one-bedroom apartment ideal to rent out if you want to generate incremental income as part of your Vanuatu investment.\r\nIn addition, there are ceiling fans throughout, beautifully manicured gardens, a double lock-up garage, a large covered deck attached to the house and a separate fare entertainment area. There is also security fencing and an entrance gate.\r\nWe love the airiness of this rock-solid island build and invite you to conduct an inspection.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680687859_642d42f399ae4.jpg',	'active',	1,	'yes',	0,	18,	0,	NULL,	'2023-04-05 20:44:19',	'2023-06-21 09:07:17',	'City Lodge, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'PORT VILA CITY',	'total price',	NULL,	NULL,	NULL,	NULL,	3),
(156,	'AFFORDABLE VIEWS',	'affordable-views',	1,	2,	55,	NULL,	NULL,	31575600.00,	'This 4-bedroom home in Bellevue is now for sale. It features a master bedroom with an ensuite and walk-in closet, another bathroom, and spacious rooms. The home is in the popular \"Bellevue 2\" area, near international schools and amenities. It has loads of storage and ceiling fans and is partially air-conditioned. It also includes security features like Crimsafe, a double carport, a rainwater tank, and a workshop. The photos show a well-presented home, which is expected to sell quickly.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680688078_642d43ce871a7.jpg',	'active',	1,	'yes',	0,	61,	0,	NULL,	'2023-04-05 20:47:58',	'2023-06-22 02:35:15',	'Bellevue Ranch, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'BELLEVUE',	'total price',	NULL,	NULL,	NULL,	NULL,	4),
