(160,	'BANANA BAY BEACH CLUB',	'banana-bay-beach-club',	1,	2,	54,	NULL,	NULL,	95235280.00,	'Banana Bay Beach Club Vanuatu\r\n\r\nLocated 20 mins drive along the eastern coast from Port Vila, Vanuatu. We provide day passes for small groups who want BYO food and cook on the BBQ or tourists who want to sit back and enjoy our tasty BBQ menu.\r\n\r\nVanuatu’s number 1 tourist destination, the Blue Lagoon just 2 mins up the road. BBBC is the only location that serves food and drinks in the area, and our business model shows more significant potential for tourists and cruise ship customers.\r\n\r\nStage 1\r\n- is complete with 15 private natural huts, engulfed by coconut palms and spotted around the water\'s edge, each with its bbq and entrance to the crystal clear natural pools, which are teaming with tropical fish.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680689031_642d4787a28f8.jpg',	'active',	1,	'yes',	0,	26,	0,	NULL,	'2023-04-05 21:03:51',	'2023-06-22 17:25:07',	'Eton beach, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'ETON',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
