(165,	'THE WHITE HOUSE',	'the-white-house',	1,	2,	55,	NULL,	NULL,	70656144.00,	'With over 40 years of living in the South Pacific, the owners have built this house to provide the ultimate tropical living experience.\r\n\r\nThis property has been built with consideration for every detail for a comfortable life in Vanuatu, including temperature, security, and natural disasters, to name a few.\r\n\r\nOnce inside the secure gating, you enter the house at the lower level with a staircase leading to the large open living area, combining lounge areas, dining, and an excellent kitchen with a slightly industrial feel.\r\n\r\nTo the rear of the house are two spacious bedrooms sharing an open-plan bathroom. The master bedroom is to the front of the house with an en-suite, walk-in wardrobe, and doors opening to the large balcony.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680690194_642d4c1233cd6.jpg',	'active',	1,	'yes',	0,	23,	0,	NULL,	'2023-04-05 21:23:14',	'2023-06-24 12:57:42',	'Malapoa College, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'MALAPOA',	'total price',	NULL,	NULL,	NULL,	NULL,	4),
(166,	'MARINA',	'marina-166',	1,	2,	54,	NULL,	NULL,	875154752.00,	'Your slice of paradise is waiting…\r\n\r\nUndine Bay Marina Estates is a new foreshore and waterways residential development situated at Undine Bay on the North shores of the main island of Efate in Vanuatu. It is an easy 35-minute drive from the airport at Port Vila.\r\n\r\nA tropical paradise located on a white coral sand beach.\r\n\r\nForeshore lots in the Marina Estate include the right to buy an allocated mooring space in the boat harbour;\r\nWaterways blocks include a right to allocate space for a pontoon jetty adjoining your property;\r\nAnd\r\n\r\n17 large rural residential foreshore properties on the eastern waterfront adjacent to the Marina Estates\r\n\r\nLocation',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1680690376_642d4cc87ceec.jpg',	'active',	1,	'yes',	0,	15,	0,	NULL,	'2023-04-05 21:26:16',	'2023-06-07 11:59:22',	'UNDINE BAY',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'UNDINE BAY',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
