(272,	'Tassiriki Island . - ID: 84989',	'tassiriki-island-id-84989',	1,	2,	55,	NULL,	NULL,	142888992.00,	'LUXURIOUS LIVING ON TASSIRIKI ISLAND\r\nSituated in an exclusive and gated community this amazing, absolute waterfront property is set on a private island which has been developed with high quality executive homes.\r\n\r\nCovenants are in place to ensure this high level of development will continue.\r\n\r\nThe island is surrounded by water and has access to the mainland via a single bridge with a security gate to control entry.\r\n\r\nThe water views are unrestricted plus you have your own small private sandy beach to launch small boats, kayaks and jet ski\'s from.\r\n\r\nThis modern, architecturally designed home is 559m2 under the main roof and is open planned and very spacious. The entrance is very grand with decorative pools either side of the main door.\r\n\r\nThe entertaining areas are certainly a wow factor as they become indoor and outdoor spaces very easily and connect with the sparking in ground pool.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1681016904_64324848a0818.jpg',	'active',	1,	'yes',	0,	22,	0,	NULL,	'2023-04-09 16:08:24',	'2023-06-13 07:00:12',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'EFATE',	'total price',	NULL,	NULL,	NULL,	NULL,	4),
