(277,	'Valesdir Plantation - ID: 132662',	'valesdir-plantation-id-132662',	1,	2,	NULL,	NULL,	NULL,	95259328.00,	'Epi Island – Agricultural land with development potential.\r\nThis amazing 539 hectare property brings together proven Agriculture business and the potential of new tourism opportunities (STA).\r\n\r\nThe property is a historic plantation which encompasses 20th century buildings, albeit have not been redeveloped post Cyclone Pam. Approx 90% of the site is usable agricultural area, with the remaining portion being uncleared and steeper land.\r\n\r\nThe concrete formed jetty is able to service medium sized boats and barges, set along the sweeping waterfront bay with white sand.\r\nOther improvements include fencing and irrigation.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1681022418_64325dd26a2a2.jpg',	'active',	0,	'no',	0,	14,	0,	NULL,	'2023-04-09 17:40:18',	'2023-06-16 02:06:31',	'Epi Frangipani Guesthouse, Epi Island, Lamen Bay, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'Epi',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
