(291,	'0 Island Magic Resort - ID: 129713',	'0-island-magic-resort-id-129713',	1,	2,	55,	NULL,	NULL,	27783970.00,	'Island Magic Resort - A fantastic lifestyle investment!\r\nNestled among lush tropical trees and gardens, Island Magic Resort overlooks the pristine waters and vibrant coral reefs of Mele Bay.\r\n\r\nOnly a 2-1/2 hour flight from Brisbane, it is an ideal location for conference groups, couples, or anyone looking to fully relax and unwind.\r\n\r\nThe bungalows are a home away from home, beautifully appointed and spaced for privacy.\r\n\r\nDo as little or as much as you like. Relax in a hammock under a shady tree or wander down to the bay for a swim or snorkel in some of the most beautiful coral reefs in Vanuatu.\r\n\r\nEnjoy a cool drink on your own private deck or at the poolside bar.\r\n\r\nOnly a 5 minute walk away is a top quality restaurant that is open for lunch or dinner. If you feel like cooking, you can wander down to the poolside BBQ Hut that seats up to 30 people.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1681027055_64326fef1bf82.jpg',	'active',	0,	'no',	0,	11,	0,	NULL,	'2023-04-09 18:57:35',	'2023-06-07 05:05:49',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'EFATE',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
