(311,	'Havannah Harbour - ID: 222728',	'havannah-harbour-id-222728',	1,	2,	54,	NULL,	NULL,	35722248.00,	'FOR ALL THE WATER BABYS\r\nBe quick on this one. On offer for sale is an amazing block of land at prestigious Havannah Harbour. The land is fully cleared and has a white sandy beach with deep crystal clear waters. Ready to build on. There are no other deep water blocks available like this with a land size of 4,645m2. The diving, snorkeling and fishing is the best that Vila can offer. The sea life is amazing and won’t disappoint. The water is like glass some days where water skiing is a must. You can moor your boat right out the front and there is a safe mariner nearby. It is a water baby’s playground and so much healthy fun to be had.\r\nThis is the ideal block for you to build your “Dream Home”.\r\nYou will never go wrong with purchasing in Havannah Harbour.',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1681031800_643282786145d.jpg',	'active',	0,	'no',	0,	21,	0,	NULL,	'2023-04-09 20:16:40',	'2023-06-16 09:00:48',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'Efate',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
