(320,	'Lot 6 Bamboo Villa - ID: 205978',	'lot-6-bamboo-villa-id-205978',	1,	2,	61,	NULL,	NULL,	1270124.00,	'BAMBOO VILLA LOCATION LOCATION\r\n3 bedroom 2 bathroom apartment on Nambatri Ridge overlooking Port Vila Harbour\r\nwith awesome dynamic views!\r\nModern, Safe, Secure and recently completely renovated apartment boasts\r\nstunning views over the Harbour. Modern inside double glazed windows and doors.\r\nBeautifully appointed with 3 bedrooms, one being the master bedroom with ensuite\r\nand 3rd room can be converted into an office space. Spacious open plan kitchen,\r\ndining and living area opens out to a generous veranda enjoying the views. Two\r\nbrand new bathrooms brand new Kitchen and freshly painted throughout.\r\nHandy to town and transport routes, a few minutes drive to town and all central\r\namenities!',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1681035361_6432906146f55.jpg',	'active',	1,	'yes',	0,	24,	0,	NULL,	'2023-04-09 21:16:01',	'2023-06-23 20:31:12',	'Nambatri Police Post, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	NULL,	'total price',	NULL,	NULL,	NULL,	NULL,	3),
(321,	'Tassiriki Tassiriki - ID: 168614',	'tassiriki-tassiriki-id-168614',	1,	2,	61,	NULL,	NULL,	9525932.00,	'2\r\n2\r\n3\r\n2 BEDROOM APARTMENT IN TASSIRIRKI\r\nThe 2 bedroom apartment is in a great location at Tassiriki, one of the more popular residential areas in Port Vila. and only a short walk to the USP (University of South Pacific) and just down the road from the French School and the International School, the property is on a good sized block with well established gardens.\r\nThe duplex has 2 apartments of 130 square meters each, both are on 2 levels, with bedrooms downstairs and open plan living, dining and kitchen upstairs. The balcony has nice views over the lagoon, which is only meters away.\r\nThe unit is fully furnished including linen, pillows, crockery, cutlery and all kitchen equipment; has modern furniture and is clean and well maintained.\r\nWell priced and perfect location. Call now to inspect!',	'+678 7754543',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1681035540_64329114cff11.jpg',	'active',	0,	'no',	0,	19,	0,	NULL,	'2023-04-09 21:19:00',	'2023-06-21 06:46:47',	'Efate Island Court, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'sqft',	'Efate',	'total price',	NULL,	NULL,	NULL,	NULL,	2),
