(324,	'COSY BUNGALOW',	'cosy-bungalow-324',	1,	2,	61,	NULL,	NULL,	7144449.00,	'This cute and cosy bungalow is located in Bukura and is to die for! With a living area of 50 m2 and an 11 m2 porch, with a beautiful view of Mele bay. Perfect for couples or a single person who appreciates a good view and peace and quiet. Only 15 - 20 minutes from town, access to the water and there is black sand beach down the road. Also comes with a lot of outdoor space and again, a killer view!\r\n\r\n\r\nIs this what you are looking for? Contact Tanya today on',	'(+678) 768 6311',	1,	1,	'rentals@iproperty.vu',	NULL,	'uploads/addss_image/1681036109_6432934dc878a.jpg',	'active',	0,	'no',	0,	19,	0,	NULL,	'2023-04-09 21:28:29',	'2023-06-19 18:58:24',	'bukura beach house, Devil\'s Point Road, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'sqft',	'BUKURA',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
