(327,	'Disaster Risk Reduction Support Officer',	'disaster-risk-reduction-support-officer',	1,	10,	146,	NULL,	NULL,	NULL,	'The Disaster Risk Reduction support Officer will assist the Project Manager in ensuring the proper implementation of the “Together, Becoming Resilient!” (TBR4) Project. This project is implemented by the VRCS in partnership with the FRC. He/she will also follow up the different VRCS/FRC activities related to Disaster Risk Reduction and Response. He/she works in close coordination with all Disaster Risk Reduction departments in the Vanuatu Red Cross Society and DRR stakeholders at the national level. He/she will ensure the sustainability and proper implementation of the DRR activities in the scope of the projects timeframe.',	'091',	1,	1,	'info@everisamting.com',	NULL,	NULL,	'active',	0,	'no',	0,	14,	0,	NULL,	'2023-04-09 21:40:27',	'2023-06-06 18:55:26',	'Port-Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'321',	NULL,	NULL,	NULL,	'2',	'Masters / MBA',	40000,	50000,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
