(331,	'K2 CAFE/RESTAURANT',	'k2-caferestaurant-331',	1,	2,	55,	NULL,	NULL,	NULL,	'Welcome to the opportunity of a lifetime! We are excited to present a thriving and successful restaurant/cafe for sale in a prime location.\r\n\r\nK2 Cafe and restaurant located on Salili road, this beloved restaurant/cafe has built a loyal customer base thanks to its delicious meals made from locally-sourced ingredients, inviting ambiance, and friendly service. With ample space, high ceilings, and natural light, this property presents an excellent opportunity for customization and expansion.\r\n\r\nThe restaurant/cafe features a kitchen, a spacious dining area, and outdoor seating for those who want to enjoy their meals al fresco.',	'+678 779 9252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681099228_643389dc75bc3.jpg',	'active',	1,	'yes',	0,	18,	0,	NULL,	'2023-04-10 15:00:28',	'2023-06-07 03:43:46',	'SALILI',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'SALILI',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(332,	'IRIRIKI ISLAND',	'iririki-island-332',	1,	2,	54,	NULL,	NULL,	10304445.00,	'Exclusive opportunity to secure your dream island apartment in Port Vila.\r\n\r\nIririki Island is a privately owned island located in the South Pacific nation of Vanuatu. The island is known for its luxury resorts and villas, as well as its pristine beaches, crystal-clear waters, and lush tropical vegetation. Iririki Island offers a wide range of activities for guests, including swimming, snorkeling, diving, fishing, and water sports. The island also features a spa and fitness center, as well as a variety of dining options. Visitors can also explore the island\'s natural beauty by taking a guided tour or going on a hike through the jungle.\r\n\r\nIririki Island is literally a 2-minute boat ride from central Port Vila and is known to be one of the most popular exclusive resorts in Port Vila Vanuatu.\r\n\r\nThis studio apartment has ocean views, an outlook to the neighboring Ifira Island, and also the Efate coastline.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681099586_64338b424e0e3.jpg',	'active',	0,	'no',	0,	16,	0,	NULL,	'2023-04-10 15:06:26',	'2023-06-07 12:41:06',	'City Lodge, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'PORT VILA CITY',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(333,	'IDEAL RESORT SITE',	'ideal-resort-site-333',	1,	2,	NULL,	NULL,	NULL,	77489792.00,	'Resort site for sale Aore Island. Perfect white sand beach. 8 Coconut Drive Lapita Beach Aore Island Vanuatu is one of the last two approved resort sites for sale on Aore Island. This is a once-in-a-lifetime opportunity to build your dream resort. The site is an approved commercial/Tourism allowing you to buy and start to build without all the headaches of getting government approval.\r\n\r\nOne hundred twenty-four meters of perfect white sand beach fringed with aquamarine waters. Perfect for swimming, snorkelling or just about any water sport.\r\n\r\nThe site is mostly clear and ready for construction as it is currently part of Lapita Plantation. It slopes up gently from the salt water, allowing your guest to take full advantage of the view and spectacular sunsets.\r\n\r\nThe resort site is relatively close to everything yet far enough away to give your guest the privacy and tranquillity that is quite hard to find in this day and age.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681099765_64338bf52fc74.jpg',	'active',	0,	'no',	0,	19,	0,	NULL,	'2023-04-10 15:09:25',	'2023-06-21 10:03:22',	'Aore Island Resort, Luganville, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	NULL,	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
