(335,	'QUEST APPARTMENTS',	'quest-appartments-335',	1,	2,	55,	NULL,	NULL,	10307311616.00,	'Established Business with a solid return.\r\n\r\nThe sale is for a multi-unit complex (formerly an accommodation business) with an adjoining block of land. There are three separate accommodation buildings, and each building is home to the following:\r\n\r\n- 2 x 1 bedroom apartments\r\n\r\n- 1 x studio apartment\r\n\r\n- 1 x 2 bedroom apartment\r\n\r\nMaking this a total offering of 15 dwellings, all with plenty of on-site parking.\r\n\r\nIn addition to the apartments, the property has a swimming pool, children\'s play area and nakamal.\r\n\r\nFormerly run as \'Quest Apartments\', and located in very secure grounds with a large carpark, you could continue to run this business as an accommodation centre or short-term rental accommodation or even further develop using the adjoining land and developing into something more.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681100558_64338f0ef07e5.jpg',	'active',	0,	'no',	0,	19,	0,	NULL,	'2023-04-10 15:22:38',	'2023-06-24 03:14:35',	'TASSIRIKI',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'TASSIRIKI',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
