(357,	'QUEST APPARTMENTS',	'quest-appartments-357',	1,	2,	NULL,	NULL,	NULL,	130000000.00,	'Established Business with a solid return.\r\n\r\nThe sale is for a multi-unit complex (formerly an accommodation business) with an adjoining block of land. There are three separate accommodation buildings, and each building is home to the following:\r\n\r\n- 2 x 1 bedroom apartments\r\n\r\n- 1 x studio apartment\r\n\r\n- 1 x 2 bedroom apartment\r\n\r\nMaking this a total offering of 15 dwellings, all with plenty of on-site parking.\r\n\r\nIn addition to the apartments, the property has a swimming pool, children\'s play area and nakamal.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681120062_6433db3e44c07.jpg',	'active',	1,	'yes',	0,	19,	0,	NULL,	'2023-04-10 20:47:42',	'2023-06-24 13:12:00',	'TASSIRIKI',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	NULL,	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(359,	'WAREHOUSE ON MELE RD',	'warehouse-on-mele-rd-359',	1,	2,	55,	NULL,	NULL,	3963574784.00,	'This commercial building of 360m2 sits on a large block of land of 2500m2 and is definitely ideal for business.\r\n\r\nBeing on the main very busy road going to Mele, its exposure is perfect as this area is dubbed to be the industrial future of Port Vila\r\n\r\nThe current owners have completely renovated and made it suitable for everyday living and business with half of the warehouse fully renovated with 3 bedrooms, 1 bathroom, and a kitchen.\r\nThe second half remains as the workshop and the ceiling of the living area, 120m2, has been set up to be used as an extra storage space.\r\nVery close to international and domestic airports.\r\n\r\nAn appointment is required for a viewing, call us now.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	NULL,	'active',	0,	'no',	0,	18,	0,	NULL,	'2023-04-10 21:03:21',	'2023-06-24 01:58:17',	'SALILI',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'SALILI',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(361,	'TROPICANA RESORT',	'tropicana-resort-361',	1,	2,	55,	NULL,	NULL,	285918464.00,	'BOUTIQUE RESORT FOR SALE\r\nTropicana Resort is conveniently located within walking distance of a supermarket, Port Vila International School (PVIS), the University of South Pacific (USP), and the Korman Sports precinct used for VAN17 Pacific Mini Games. Port Vila downtown is a short 5 min bus ride away.\r\n\r\nThe 18 self-contained apartments are in two concrete buildings and tastefully furnished with quality interiors. Ample parking, a swimming pool, a private beach, and an over-water restaurant for up to 40 guests provide all the resort facilities guests wish for but without the crowds of the larger resort chains. Tropicana caters to both holiday guests and short/long-term corporate guests.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681121897_6433e26933cc5.jpg',	'active',	0,	'no',	0,	18,	0,	NULL,	'2023-04-10 21:18:17',	'2023-06-17 02:13:04',	'SECOND LAGOON',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'SECOND LAGOON',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
