(363,	'LAGOON VILLAS',	'lagoon-villas-363',	1,	2,	55,	NULL,	NULL,	5875512832.00,	'Lagoon Villas\r\nAn investor\'s dream!\r\n\r\nFor sale are 4 villas located opposite the new VAN17 Pacific Mini Games sporting complex and only a short walk to ABM supermarket, the University of South Pacific, food markets, several waterfront restaurants, and Port Vila International School.\r\n\r\nThere are 2 x 2 bedrooms offering 106m2 of living and 2 x 3 bedroom villas offering 116m2 of living. Each villa comes with its own plunge pool and low-maintenance yard. Each villa is separately fenced and includes a modern interior, washing machine, a/c, satellite TV, internet ready, and own car park. Each villa is ready to move in should you wish or be tenanted for the investor buyer.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681122425_6433e47907c50.jpg',	'active',	1,	'yes',	0,	23,	0,	NULL,	'2023-04-10 21:27:05',	'2023-06-24 13:59:49',	'SECOND LAGOON',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	'SECOND LAGOON',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(364,	'COCO BEACH',	'coco-beach-364',	1,	2,	54,	NULL,	NULL,	234206816.00,	'BEACH RESORT FOR SALE\r\nBEACH RESORT FOR SALE\r\n\r\nWelcome to Coco Beach Vanuatu!\r\n\r\nSituated on a beautiful private white sandy beach with crystal clear waters, Coco Beach Resort offers 15 luxurious farés, fabulous dining right on the water, great swimming and snorkelling, surrounded by stunning scenery and amazing year-round sunsets.\r\n\r\nThis family-owned resort is located 15 minutes from Port Vila town centre and 25 minutes from Port Vila International Airport. But why drive there when you can arrive by boat? With a dedicated channel allowing for deep water access, this resort is one of a kind and is popular with cruise ship day visitors. The 15 bungalows include four beachfront, five ocean views and six garden views on 5,748m2 of tropical landscaped grounds. The bungalows are tastefully appointed and are built with light concrete panels and natural Natangura roofs.',	'+67823455',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681122649_6433e5595ad80.jpg',	'active',	0,	'no',	0,	18,	0,	NULL,	'2023-04-10 21:30:49',	'2023-06-07 11:34:37',	'Paradise Cove Resort, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'commercial',	NULL,	'sqft',	NULL,	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(367,	'PAVILLION STYLE VILLAS',	'pavillion-style-villas-367',	1,	2,	55,	NULL,	NULL,	91273104.00,	'Are you ready for the ultimate seafront experience? Look no further! This unique property is an absolute gem - it\'s cyclone-proof, breathtakingly beautiful, and boasts nearly 3 acres of professionally landscaped park-like gardens. With 85 meters of ocean frontage, this property is a true paradise.\r\n\r\nThe best part? The property has been meticulously renovated from roof to floor by an Engineer and an Interior Designer. No detail has been overlooked! And let\'s talk about the materials - this place has been built to last with concrete and hardwood. The result? A stunning masterpiece that will make you the envy of all your friends and family.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681186250_6434ddcaa75e7.jpg',	'active',	0,	'no',	0,	16,	0,	NULL,	'2023-04-11 15:10:50',	'2023-06-24 13:17:05',	'Narpow Point Heights Subdivision, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'NARPOW POINT',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(368,	'HAVANNAH NAH NAH NAH',	'havannah-nah-nah-nah-368',	1,	2,	54,	NULL,	NULL,	33746152.00,	'Offered at 425,000 AUD ONO, this is one of the largest private waterfront lots at exclusive Havannah Harbour! Location, location + 4,545m2 of nearly flat land gently sloping to 31m of private beach, just properly cleared and ready to build. The aspects and views are perfect, including early sunrise poking over the gorgeous forest hills at dawn to the right, stunning sunsets over the islands of Lelepa and Moso to the left, views of distant Hat Island to the South and the gorgeous and tranquil Havannah Harbour right in front to the North. Deep water access for any vessel and secure mooring site. Havannah Harbour is a water sports heaven, from swimming and snorkelling to SUP, diving, jet and water skiing. Game fishing charters operate from the area catching martin, tuna and other fabulous fish, and when it\'s time to eat and drink, several restaurants and bars of any standard are just a stroll or short boat ride away. If you enjoy a good lifestyle, this block will not be missed!',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681186488_6434deb87eaad.jpg',	'active',	1,	'yes',	0,	19,	0,	NULL,	'2023-04-11 15:14:48',	'2023-06-07 09:10:07',	'Havannah Boat House, Port Havannah, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'HAVANNAH',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(369,	'MOUNTAIN RANCH',	'mountain-ranch-369',	1,	2,	55,	NULL,	NULL,	55577528.00,	'Hey there, tired of the rat race and craving a tropical escape? Look no further than this slice of paradise in Vanuatu!\r\n\r\nSpread across a whopping 3.8 hectares, this property is bursting with mature trees, and tropical flowers, and even has its own chicken coop for fresh eggs every morning. Plus, the fertile land means you can grow your own organic produce - say goodbye to supermarket veggies with no taste!\r\n\r\nAfter a long day of lounging by the pool and soaking up the sun, head to the massive shed to tinker with your tools, including a tractor and slasher. And when it\'s time to relax, the high-ceilinged house boasts 4 spacious bedrooms and 3 bathrooms, complete with a large kitchen and pantry for cooking up a storm.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681186714_6434df9a9ed41.jpg',	'active',	1,	'yes',	0,	27,	0,	NULL,	'2023-04-11 15:18:34',	'2023-06-17 15:02:33',	'TAMATE',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'TAMATE',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(370,	'EPI-TOME OF WATERFRONT PROPERTY!',	'epi-tome-of-waterfront-property-370',	1,	2,	54,	NULL,	NULL,	134523808.00,	'Get ready to make waves in the world of real estate with this Epi-tome of waterfront property! This 13-acre slice of paradise boasts a whopping 770 meters of ocean frontage and is spread across not one, not two, but SEVEN separate commercial titles, each with its very own waterfront view. If you\'re looking for a place to call your own, this property will have you feeling like you\'re on top of the world!\r\n\r\nBut wait, there\'s more! This property comes complete with a 338 sq m, 7-bedroom, 4-bathroom, 2-story hardwood timber/iron roof house, perfect for hosting all of your closest friends and family (or, let\'s be real, turning into a party palace). And if that\'s not enough space for you, there\'s also a 220 sq m, 1-bedroom, 1-bathroom, single-story concrete block/iron roof cabin with a full-sized kitchen and huge verandah that\'s just begging for a lazy Sunday afternoon spent lounging around.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681186998_6434e0b6c7c71.jpg',	'active',	1,	'yes',	0,	21,	0,	NULL,	'2023-04-11 15:23:18',	'2023-06-16 17:41:33',	'Epi Frangipani Guesthouse, Epi Island, Lamen Bay, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'EPI',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(371,	'LARGE FAMILY HOME + POOL',	'large-family-home-pool-371',	1,	2,	55,	NULL,	NULL,	45148492.00,	'This spacious 4-bedroom, 3-bathroom home sits at the end of a \"no-through road\" in Nambatri, offering privacy and tranquil views of the adjoining hotel golf course. The property is securely enclosed within a 2,314 m2 site, with concrete and mesh wire fencing and two new electric gates. The land is elevated in some areas, making it an ideal spot to build a second home or duplex with private access for rental income or additional family housing.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681187221_6434e1954e266.jpg',	'active',	1,	'yes',	0,	18,	0,	NULL,	'2023-04-11 15:27:01',	'2023-06-18 09:58:52',	'Nambatri Police Post, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	NULL,	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(372,	'LARGE BLOCK',	'large-block-372',	1,	2,	54,	NULL,	NULL,	15790699.00,	'Don\'t miss this incredible opportunity to invest in one of Vanuatu\'s most exquisite locations with this amazing vacant land for sale!\r\n\r\nComprising of two land leases for the price of one, this property is a real gem. The first lease is a residential waterfront block, offering a total of 3913sqm with a breathtaking 40m of absolute beach frontage. The second lease is a commercial roadblock, boasting a total area of 6085 sqm.\r\n\r\nNot only does this property offer size and stunning waterfront views, but it is also easily accessible via a sealed road, with mains power and water via a bore. The location is perfect for those who seek tropical island living with lush green surroundings, untouched and clean, and ready for you to build on now.\r\n\r\nDon\'t let this opportunity pass you by. Contact us today to learn more and to arrange a viewing of this spectacular property!',	'+678 767 5037',	1,	1,	'admin@iproperty.vu',	NULL,	'uploads/addss_image/1681187566_6434e2ee4cdec.jpg',	'active',	1,	'yes',	0,	9,	0,	NULL,	'2023-04-11 15:32:46',	'2023-06-16 08:59:18',	'UNDINE BAY',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	NULL,	'total price',	NULL,	NULL,	NULL,	NULL,	10000),
(373,	'LAMA MOUNT SUBDIVISION',	'lama-mount-subdivision',	1,	2,	54,	NULL,	NULL,	NULL,	'Introducing a new land subdivision that has great potential and an incredible deal! This subdivision is located in the outskirts of Port Vila, more specifically Clems Hill and offers an opportunity for investors, developers, and homebuyers.\r\n\r\nThe land consists of 130 lots and is zoned for residential use HOWEVER we are currently only selling 20. The lots range in size from 1,349 m2 to 2,420 m2, giving homebuyers a range of options to choose from.\r\nInvestors and developers will appreciate the subdivision\'s potential for long-term growth and appreciation. The area is primed for development, and with the right vision, this subdivision could become a sought-after destination for families.',	'+678 779 9252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681187925_6434e45507101.jpg',	'active',	0,	'no',	0,	16,	0,	NULL,	'2023-04-11 15:38:45',	'2023-06-24 13:56:42',	'KLEMS HILL',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'KLEMS HILL',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
