(375,	'QUALIUS',	'qualius',	1,	2,	55,	NULL,	NULL,	102909360.00,	'Introducing Qualius Vanuatu, the ultimate South Pacific retreat. This 4-bedroom waterfront property boasts breathtaking views of the crystal blue waters of Mele Bay, providing an unrivalled experience for those seeking a luxurious island getaway.\r\nLocated on 2.5 acres of lush manicured gardens beneath a 100-year-old tropical rainforest canopy, Qualius offers a tranquil escape from the hustle and bustle of daily life. The gardens are filled with tropical plants and flowers, while local chickens forage for food and lay fresh organic eggs for guests to enjoy.\r\nWhen you arrive home, you are greeted with a private 270-degree view of the sea and a cooling breeze that instantly transports them to a state of relaxation. The property features a swimming pool for guests to cool off and direct access to a marine sanctuary where dolphins, turtles, and schools of fish can be spotted.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681188910_6434e82e55d40.jpg',	'active',	1,	'yes',	0,	10,	0,	NULL,	'2023-04-11 15:55:10',	'2023-06-07 07:52:45',	'bukura beach house, Devil\'s Point Road, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'BUKURA',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
