(377,	'LOT 4 DUPLEX',	'lot-4-duplex',	1,	2,	55,	NULL,	NULL,	46583740.00,	'Indulge in the ultimate beachfront living experience with these stunning duplex homes on Lot 4 of Mele Cove Estate, now available for purchase.\r\n\r\nThe possibilities are endless with two beautifully appointed one-bedroom duplex homes already built on this vast 1763m2 piece of land. You have the option to build up to three more homes or any accompanying building on the block, such as a guest house, creating your very own slice of paradise.\r\n\r\nThis property is an absolute beachfront gem situated on the beach at Mele Cove Estate. The duplex homes come with air-conditioning and offer a perfectly sized deck for you to sit back, relax, and watch the world go by while the waves roll in.\r\n\r\nWith the potential to take this waterfront land to the next level, this is a rare investment opportunity not to be missed.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681191904_6434f3e0cb983.jpg',	'active',	1,	'yes',	0,	23,	0,	NULL,	'2023-04-11 16:45:04',	'2023-06-19 09:00:45',	'MELE COVE',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'MELE COVE',	'total price',	NULL,	NULL,	NULL,	NULL,	4),
