(380,	'3 BEDROOM WITH A POOL',	'3-bedroom-with-a-pool',	1,	2,	55,	NULL,	NULL,	2382855936.00,	'Welcome to your tropical oasis in Bellevue, Vanuatu! This stunning 3-bedroom, 2-bathroom house boasts the perfect combination of convenience and comfort. The moment you step inside, you\'ll be greeted by a spacious and open floor plan that is perfect for entertaining guests or relaxing with family.\r\n\r\nThe beautifully appointed kitchen features ample storage space, and a convenient breakfast bar, making it the ideal place to whip up delicious meals. The cozy living room is complete with comfortable furnishings and plenty of natural light, making it the perfect place to unwind after a long day.\r\n\r\nEach of the three bedrooms is spacious, featuring ample closet space, comfortable bedding, and plenty of natural light. The master bedroom is a true retreat, featuring a luxurious en-suite bathroom with a spa-like shower and dual vanity.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681192847_6434f78fb2d5a.jpg',	'active',	1,	'yes',	0,	16,	0,	NULL,	'2023-04-11 17:00:47',	'2023-06-07 06:54:14',	'Bellevue Ranch, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'BELLEVUE',	'total price',	NULL,	NULL,	NULL,	NULL,	3),
