(385,	'CHATEAUX',	'chateaux',	1,	2,	55,	NULL,	NULL,	7945631232.00,	'Experience the ultimate in tropical living with this unique and modern complex of apartments. Each unit has been designed with the highest standards of comfort and style, offering the perfect retreat for peace and relaxation.\r\n\r\nUnit 1: A spacious one-bedroom unit with air-conditioning and fully furnished. Enjoy your own private fenced yard and carport, as well as your own entry and laundry facilities.\r\n\r\nUnit 2: This two-bedroom unit features air-conditioning and an ensuite, as well as a separate study/nook. The unit is fully furnished and includes a second bathroom, fenced yard, and off-street parking. You\'ll also have your own laundry facilities for added convenience.',	'+678 779 9252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681194498_6434fe02b5b84.jpg',	'active',	1,	'yes',	0,	19,	0,	NULL,	'2023-04-11 17:28:18',	'2023-06-21 06:50:01',	'Bellevue Ranch, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'BELLEVUE',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(386,	'YOUR NEW HOUSE ON THE LAGOON',	'your-new-house-on-the-lagoon-386',	1,	2,	55,	NULL,	NULL,	44093856.00,	'Spacious 3 bedroom, 2 bathroom house available for rent in Tassiriki area.\r\n\r\nLocation:\r\nJust a stone throw away from PVIS school & down a quiet cul de sac street on the Tassiriki lagoon.\r\n\r\n9 Features:\r\n- Very large and spacious home within secure yard & electric gate.\r\n- High ceilings, which allow for great ventilation and loads of natural light\r\n- 3 Bedrooms with in built wardrobes\r\n- 2 Bathrooms with toilet & shower and in built shelves\r\n- Spacious open plan living/dining area with dining table and couch\r\n- Large covered terrace for outdoor living - a must in our tropical climate\r\n- Beautiful and spacious garden that gives onto the first lagoon (steps into the water) with a gorgeous selection of fruit and shady trees',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681194729_6434fee9d2341.jpg',	'active',	1,	'yes',	0,	15,	0,	NULL,	'2023-04-11 17:32:09',	'2023-06-18 23:57:05',	'TASSIRIKI',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'TASSIRIKI',	'total price',	NULL,	NULL,	NULL,	NULL,	3),
(387,	'STYLISH HOME IN TOWN',	'stylish-home-in-town-387',	1,	2,	55,	NULL,	NULL,	39308820.00,	'LOCATION, LOCATION, LOCATION\r\nLOCATION, LOCATION, LOCATION\r\n\r\n\r\nWant to be in the centre of town? This is a must-see.\r\nUpstairs is the primary residence with two bedrooms and two bathrooms. You will also enjoy spectacular harbour views from the balcony and raked high ceilings with exposed timber beams—a truly stunning feature in this island home.\r\nDownstairs is an entirely separate one-bedroom apartment ideal to rent out if you want to generate incremental income as part of your Vanuatu investment.\r\nIn addition, there are ceiling fans throughout, beautifully manicured gardens, a double lock-up garage, a large covered deck attached to the house and a separate fare entertainment area. There is also security fencing and an entrance gate.\r\nWe love the airiness of this rock-solid island build and invite you to conduct an inspection',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681195280_6435011021744.jpg',	'active',	1,	'yes',	0,	13,	0,	NULL,	'2023-04-11 17:41:20',	'2023-06-07 02:13:10',	'City Lodge, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'PORT VILA CITY',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
