(389,	'TOWNHOUSES WITH A VIEW',	'townhouses-with-a-view',	1,	2,	55,	NULL,	NULL,	NULL,	'Calling all first homeowners!!!!!!!\r\n\r\nThese well-put-together three-bedroom two bathroom townhouses feature an open-plan living room that flows into a large kitchen.\r\n\r\nThe master suite is light and airy, with a walk-in robe and full ensuite.\r\n\r\nThe two other bedrooms are joined by a Jack \'n\' Jill bathroom.\r\n\r\nThe complex has a communal pool and tropical gardens for everyone to enjoy.\r\n\r\nThere are four townhouses in the complex for sale.\r\n\r\nThe well-priced townhouses have stunning views of Erakor island, properties like this for under 25 million are unheard of. Don\'t miss out on this oppertunity.\r\n\r\nCall now for a viewing.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681196043_6435040b7dcdb.png',	'active',	1,	'yes',	0,	17,	0,	NULL,	'2023-04-11 17:54:03',	'2023-06-16 10:37:58',	'Elluk Plateau, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'ELLUK',	'total price',	NULL,	NULL,	NULL,	NULL,	3),
