(395,	'WATERFRONT BLOCKS',	'waterfront-blocks',	1,	2,	54,	NULL,	NULL,	NULL,	'Your slice of paradise is waiting…\r\n\r\nEfate is the main island of Vanuatu, where the capital city Port Vila is situated, and the majority of commerce and tourism activities occur.\r\n\r\nA mere 40 km from the International Airport at Port Vila, Undine Bay Marina Estates is located on the shores of the beautiful North-facing Undine Bay, surrounded by the islands of Nguna, Pele, and Kakula. It is an easy 35-minute drive from Port Vila on the sealed Ring Road.\r\n\r\nA tropical paradise located on a white coral sand beach.\r\n\r\nForeshore lots in the Marina Estate include the right to buy an allocated mooring space in the boat harbour;\r\nWaterways blocks include a right to allocate space for a pontoon jetty adjoining your property. There were 17 rural residential foreshore properties on the easte',	'+678 767 5037',	1,	1,	'admin@iproperty.vu',	NULL,	'uploads/addss_image/1681198882_64350f224da10.jpg',	'active',	1,	'yes',	0,	22,	0,	NULL,	'2023-04-11 18:41:22',	'2023-06-24 01:55:23',	'UNDINE BAY',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'UNDINE BAY',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(397,	'BANANA BAY BEACH CLUB',	'banana-bay-beach-club-397',	1,	2,	55,	NULL,	NULL,	95019064.00,	'Banana Bay Beach Club Vanuatu\r\n\r\nLocated 20 mins drive along the eastern coast from Port Vila, Vanuatu. We provide day passes for small groups who want BYO food and cook on the BBQ or tourists who want to sit back and enjoy our tasty BBQ menu.\r\n\r\nVanuatu’s number 1 tourist destination, the Blue Lagoon just 2 mins up the road. BBBC is the only location that serves food and drinks in the area, and our business model shows more significant potential for tourists and cruise ship customers.\r\n\r\nStage 1\r\n- is complete with 15 private natural huts, engulfed by coconut palms and spotted around the water\'s edge, each with its bbq and entrance to the crystal clear natural pools, which are teaming with tropical fish.',	'01770802187',	1,	1,	'info@everisamting.com',	NULL,	'uploads/addss_image/1681199309_643510cd577c2.jpg',	'active',	1,	'yes',	0,	30,	0,	NULL,	'2023-04-11 18:48:29',	'2023-06-23 20:56:31',	'Eton beach, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'ETON',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(399,	'THE WHITE HOUSE',	'the-white-house-399',	1,	2,	55,	NULL,	NULL,	70458168.00,	'With over 40 years of living in the South Pacific, the owners have built this house to provide the ultimate tropical living experience.\r\n\r\nThis property has been built with consideration for every detail for a comfortable life in Vanuatu, including temperature, security, and natural disasters, to name a few.\r\n\r\nOnce inside the secure gating, you enter the house at the lower level with a staircase leading to the large open living area, combining lounge areas, dining, and an excellent kitchen with a slightly industrial feel.\r\n\r\nTo the rear of the house are two spacious bedrooms sharing an open-plan bathroom. The master bedroom is to the front of the house with an en-suite, walk-in wardrobe, and doors opening to the large balcony.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681199804_643512bc37f67.jpg',	'active',	1,	'yes',	0,	23,	0,	NULL,	'2023-04-11 18:56:44',	'2023-06-22 18:50:58',	'Malapoa College, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'MALAPOA',	'total price',	NULL,	NULL,	NULL,	NULL,	4),
