(401,	'LOT 7',	'lot-7',	1,	2,	55,	NULL,	NULL,	63248928.00,	'Lot 7 is hidden in tropical foliage in The Estate at Eton reef. It is a gorgeous modern compound just a minute away from the idyllic beaches and turquoise-blue swimming holes scattered around the estate.\r\n\r\nPerfect for someone who loves the outdoor lifestyle and wants resort-style living next to the ocean. This location is ideal if you love watching the tides and listening to the rolling waves!\r\n\r\nThe house comes with two bedrooms. Each has its ensuite bathroom. A spacious living room flows into the kitchen and out onto the veranda where you find a view the lush tropical gardens.\r\n\r\nA truly charming property, only 20 minutes to Port Vila town centre and 30 minutes to the international airport!\r\n\r\nContact Sam for a viewing.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681201095_643517c70e3cc.jpg',	'active',	0,	'no',	0,	17,	0,	NULL,	'2023-04-11 19:18:15',	'2023-06-23 23:33:39',	'Eton Reef Private Resort, Efate, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'ETON REEF',	'total price',	NULL,	NULL,	NULL,	NULL,	2),
(402,	'THE ESTATE',	'the-estate-402',	1,	2,	55,	NULL,	NULL,	15877967.00,	'THE ESTATE at Eton Reef\r\nTHE ESTATE\r\nat Eton Reef\r\n\r\nEton Reef Estate is 20 minutes to Vanuatu’s capital Port Vila, and only 40 minutes to Bauerfield international airport. It comprises of 74 acres of shared parkland with 4.5km of forest and coastal walking trails. A total of 2 kms of ocean frontage with countless beaches, 16 secluded picnic coves, and a 60-metre all-tide swimming pool.\r\nThere are 35 lots for sale, with each entire lot being 45m wide and an average of 3,350m² per whole lot. It is only a 3-hour flight from Auckland or Sydney or a 1-hour flight from Fiji or New Caledonia. 0% tax, 0% stress, 100% organic, and 100% happiness.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681201338_643518baa31cb.jpg',	'active',	1,	'yes',	0,	26,	0,	NULL,	'2023-04-11 19:22:18',	'2023-06-22 18:45:27',	'Eton Reef Private Resort, Efate, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'ETON REEF',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(403,	'PRICED TO SELL',	'priced-to-sell',	1,	2,	55,	NULL,	NULL,	67455136.00,	'Located at Angelfish Cove, this majestic property is a must-see. You can be at home and feel like you\'re on holiday. The extensive grounds and gardens are beautifully landscaped and laid to grass.\r\n\r\nEnjoy 30 metres of absolute beachfront. Angelfish Cove is known for fantastic snorkelling, water sports and diving. The waters are safe and sheltered due to a reef between the islands.\r\n\r\nThis home features three double bedrooms, two bathrooms, a primary with an ensuite and walk-in robe, and a study/office. It is fully tiled with ceiling fans and air conditioning in all bedrooms.\r\n\r\nEnjoy the very spacious lounge, dining and kitchen areas.\r\nThis home is an entertainer\'s delight. Numerous eating areas and a great undercover entertainment area overlook',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681201608_643519c846cc0.jpg',	'active',	0,	'no',	0,	20,	0,	NULL,	'2023-04-11 19:26:48',	'2023-06-16 21:35:21',	'Angelfish Cove Villas, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'ANGELFISH COVE',	'total price',	NULL,	NULL,	NULL,	NULL,	3),
