(407,	'RESORT STYLE MULTI DWELLING',	'resort-style-multi-dwelling',	1,	2,	55,	NULL,	NULL,	54723560.00,	'WHAT A FANTASTIC INVESTMENT!!!\r\n\r\nAs you pull up to this property, you are greeted by beautifully manicured tropical gardens that pull you towards the blue waters of the second lagoon.\r\n\r\nThe resort-style set up comprises the following.\r\n\r\n1 x two bedroom, one bathroom bungalows\r\n\r\n2 x two bedroom, two bathroom bungalows\r\n\r\n1 x one bedroom, one bathroom bungalow\r\n\r\nIn addition, two containers are ready for conversion into an additional two-bedroom Bungalow with storage.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681204860_6435267c2b656.jpg',	'active',	1,	'yes',	0,	23,	0,	NULL,	'2023-04-11 20:21:00',	'2023-06-22 14:09:03',	'SECOND LAGOON',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'SECOND LAGOON',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(408,	'PAPAYA VILLA',	'papaya-villa',	1,	2,	55,	NULL,	NULL,	94905128.00,	'This breathtakingly unique property is situated on a lush green and mature 2922 square metre block of land in the exclusive Eton Reef Estate. As you enter the property, you are greeted by rows of palm trees and tropical fauna that entices you towards the main villa.\r\nThe Primary residence combines Latin Caribbean Flare with a homely Mediterranean calm that makes you want to watch the tides and listen to the rolling waves. This two-story Mediterranean-inspired home has an inspiring owner\'s suite upstairs with a large king-size bedroom and ensuite adjoining a generous sitting room and home office.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681205105_6435277118a85.jpg',	'active',	0,	'no',	0,	21,	0,	NULL,	'2023-04-11 20:25:05',	'2023-06-19 09:18:55',	'Eton beach, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'ETON',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(409,	'PANGONA PARADISE LOT 29,30',	'pangona-paradise-lot-2930-409',	1,	2,	54,	NULL,	NULL,	17435870.00,	'Three STUNNING adjoining oceanfront blocks will be sold as one large package or as individual sections if preferred.\r\nThese lovely large lots are located in Pangona Estate, a fine waterfront estate approximately 20 minutes drive from Port Vila. The estate faces west-south-west.\r\nThe average size is 10,500m2 per lot, and the average linear ocean frontage is 60+m.\r\nLot 31 is 9,841sqm SOLD\r\nLot 30 is 11,171sqm\r\nLot 29 is 11,038sqm\r\nA total of 3.2 hectares\r\nThe three blocks are fenced with a very well-constructed tall coral wall.\r\nThere are wooden gates to enter the two outside lots and two gardener\'s houses built on the two outside lots.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681205702_643529c6510aa.jpg',	'active',	1,	'yes',	0,	25,	0,	NULL,	'2023-04-11 20:35:02',	'2023-06-22 13:26:40',	'PANGONA',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'PANGONA',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(411,	'DULPLEX WITH A VIEW',	'dulplex-with-a-view',	1,	2,	55,	NULL,	NULL,	NULL,	'This 4 bedroom 4 bathroom duplex overlooking Mele bay is the ultimate renovator\'s dream.\r\n\r\nThe duplex has vaulted ceilings with twin master suites, ensuites and double lock-up garages in both duplexes.\r\n\r\nThis is the ultimate \"doer upper\" and is priced to sell fast.\r\n\r\nDon\'t miss out call now for an inspection.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681207291_64352ffb9047c.jpg',	'active',	0,	'no',	0,	18,	0,	NULL,	'2023-04-11 21:01:31',	'2023-06-16 22:36:24',	'Elluk Plateau, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'ELLUK',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(412,	'BEACH COTTAGE AORE ISLAND',	'beach-cottage-aore-island',	1,	2,	55,	NULL,	NULL,	59358340.00,	'Come to Beautiful Aore Island Vanuatu, kick back, enjoy the view over the Segond Channel, and watch the sunset from the 160m2 deck in this spacious 2-bedroom,2-bathroom open plan home. Double shower in the main bathroom.\r\nThis property is operating as a successful Airbnb in a separate bungalow with bookings up to May next year. Also on the property is a substantial 14x7 metre workshop( mancave) with a mezzanine floor, plus a shower and toilet for the handyman.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681208400_64353450223fe.jpg',	'active',	1,	'yes',	0,	46,	0,	NULL,	'2023-04-11 21:20:00',	'2023-06-22 17:10:08',	'Aore Island Resort, Luganville, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'AORE ISLAND',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(413,	'IDEALIC HOBBY FARM',	'idealic-hobby-farm-413',	1,	2,	54,	NULL,	NULL,	25739662.00,	'Perfect Hobbie Farm\r\n\r\nA beautiful flat block of land offering more than 15,000m2.\r\n\r\nThis stunning lifestyle property is only a 10-minute drive from Port Vila. The magnificent Mele black sand beach is within walking distance of the land, 120 meters away.\r\n\r\nWith a carefree two-bedroom, the two-bathroom house already set on the land, the accommodation on site is provided while you prepare your plans and build your dream farmhouse.\r\n\r\nThe land has beautiful rich soil and mature fruit trees; this place is ideal for the whole family to live and enjoy a peaceful and stress-free life.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681208666_6435355aa40be.jpg',	'active',	1,	'yes',	0,	25,	0,	NULL,	'2023-04-11 21:24:26',	'2023-06-22 10:52:11',	'MELE BAY',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'MELE BAY',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(414,	'LIFESTYLE PROPERTY',	'lifestyle-property',	1,	2,	NULL,	NULL,	NULL,	35402192.00,	'This lovely renovated 2 bedrooms home offers the perfect layout for rural living.\r\nOpen living plan with high ceilings opening to a large verandah with a view to the beautiful well grown and landscaped garden. The place is always cool and airy.\r\n\r\nThe grounds offer many native and tropical trees to enjoy, this is truly an amazing opportunity to get a piece of paradise.\r\n\r\nSo much space around to extend further or build a second larger home or enjoy the beauty this lifestyle property has to offer.\r\n\r\nIt is only 100 meters away from the magnificent black sand beach of Mele Bay, coming back from a long day at work and jumping in the sea to refresh yourself and relax could be your everyday routine.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681208879_6435362f68f44.jpg',	'active',	1,	'yes',	0,	27,	0,	NULL,	'2023-04-11 21:27:59',	'2023-06-22 20:44:42',	'MELE BAY',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	NULL,	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(416,	'COLONIAL HOME ON AN ACRAGE',	'colonial-home-on-an-acrage',	1,	2,	55,	NULL,	NULL,	4710926.00,	'This spectacular and large colonial-style home in rural Bellevue is now available.\r\nAnd yes, it\'s as stunning in real life as in the pictures.\r\nSo do just that and picture yourself here. Take in the scenery of your lush tropical landscaped garden while relaxing poolside and enjoying all that island living brings.\r\nThe property is 9276m2 in size and features:\r\n- expansive 350m2 of living space (excluding the terrace)\r\n- fully fenced\r\n- 4 bedrooms, including a master with ensuite\r\n- office/rumpus room\r\n- a terrace that wraps around three sides of the home\r\n- stunning inground swimming pool\r\n- nakamal for entertaining set amongst the tropical gardens plus fish pond\r\n- gardens feature an abundance of fruit trees, tropical flowers and established trees\r\n- additional storeroom located in the gardens\r\n- solar heating plus water tank\r\n- carport',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	NULL,	'active',	0,	'no',	0,	22,	0,	NULL,	'2023-04-11 22:37:52',	'2023-06-21 14:32:19',	'Bellevue Ranch, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'BELLEVUE',	'total price',	NULL,	NULL,	NULL,	NULL,	4),
(417,	'EXECUTIVE PROPERTY',	'executive-property',	1,	2,	55,	NULL,	NULL,	197688720.00,	'This is the height of luxury island living.\r\nThis is the height of luxury island living.\r\n\r\nThis stunning architecturally designed home constructed from concrete and steel to the highest structural standards for both earthquakes and cyclones is situated in one of Port Vila\'s most desirable locations.\r\n\r\nThis executive-level home boasts five large bedrooms & 5.5 bathrooms. It includes an external granny flat, office, kids’ playroom, media room, dining room, living room, Bi-fold CrimeSafe* enclosed terrace, pool',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681213623_643548b7ee464.jpg',	'active',	0,	'no',	0,	25,	0,	NULL,	'2023-04-11 22:47:03',	'2023-06-23 13:45:35',	'11 PARADISE POINT',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'11 PARADISE POINT',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(419,	'BEST VIEW IN TOWN',	'best-view-in-town',	1,	2,	55,	NULL,	NULL,	118532352.00,	'If you genuinely desire a luxury residence with the best view in town, overlooking both the 1st and 2nd lagoons with a clear run out to the pacific ocean, this view will take your breath away.\r\nAs you enter this Deluxe residence, you are greeted with 15 plus ft ornate ceiling with custom lighting and a chandelier that leads you seamlessly through the luxury interiors to the crystal blue swimming pool overlooking looking a unique tropical and blue water landscape. You will feel you are swimming in the clouds.\r\nthis large 1973sqm property has three dwellings in total:\r\n1/ The main house with two bedrooms, two bathrooms, and a huge walk-in robe, the home is ideal for entertaining with the expansive living area, dining room, and open plan kitchen that sprawls out onto the indoor/outdoor living space.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	NULL,	'active',	0,	'no',	0,	26,	0,	NULL,	'2023-04-11 23:01:51',	'2023-06-23 15:48:40',	'Bellevue Ranch, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'BELLEVUE',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(420,	'MARINA',	'marina-420',	1,	2,	55,	NULL,	NULL,	14252880.00,	'OUR MARINA\r\nMore days on the water – that’s what it’s all about. The sheltered channel of The Point Marina provides quick access to world-class fishing, diving, spearfishing and more.\r\n\r\nThe Point Marina provides private boating facilities exclusively for residents, including a boat ramp and marina berths. Marina berths are available in a range of sizes to accommodate boats up to 20 metres in length. Should you require boat yard facilities, we are located less than 2 nautical miles from Port Vila Boatyard.\r\n\r\nThe Point Marina is the place to base your boating lifestyle.\r\n\r\nLand only or Land and Marina Berth Licence packages are available',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681214791_64354d47d8168.jpg',	'active',	1,	'yes',	0,	44,	0,	NULL,	'2023-04-11 23:06:31',	'2023-06-23 03:48:19',	'Pango Point Residence, Pango Rd, Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'PANGO POINT',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(421,	'MODERN BALINESE STYLE VILLA',	'modern-balinese-style-villa',	1,	2,	55,	NULL,	NULL,	173958336.00,	'A private 4- Bedroom Beachfront Villa in the Beautiful Area of Paradise Point.\r\n\r\nThis villa is built by Vanuatu\'s most acclaimed builder, with a combination of luxury and simplicity in mind.\r\nThis stunning compound sits on a picturesque block overlooking Port Vila Harbour, with a serine private beach to catch the fresh, cool coastal breezes.\r\n\r\nTHE VILLA IS SET UP FOR THE ULTIMATE PRIVACY. Behind the 3-meter walls is a tranquil swimming pool featuring floating stepping stones as an entry to the property; you immediately feel as if you are crossing the mote into an exceptional property.\r\n\r\nAs you step into the minimal and sophisticated open-plan living area, you are immediately drawn to the crystal blue waters of Port Vila harbour and the lush greenery of the iconic Iririki Island in the background.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681215004_64354e1ce966d.jpg',	'active',	0,	'no',	0,	24,	0,	NULL,	'2023-04-11 23:10:04',	'2023-06-23 13:52:23',	'PARADISE POINT',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'PARADISE POINT',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(422,	'LIFESTYLE PROPERTY',	'lifestyle-property-422',	1,	2,	NULL,	NULL,	NULL,	76756904.00,	'Probably Vanuatu’s best lifestyle property.\r\n\r\nBenefiting from a labour of love renovation over the last two years, with all materials being imported directly from Australia.\r\nTucked away 50 metres back from the centre of the famous Mele volcanic black sand beach, which is perfect for swimming, paddleboarding and snorkelling, and an easy 10 minutes from the city centre, you will find what is probably Vanuatu\'s premier lifestyle property.\r\nBehind an unassuming façade, you will find several hundred square metres of beautiful hardwood decks, including',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681215289_64354f39dca8b.jpg',	'active',	0,	'no',	0,	26,	0,	NULL,	'2023-04-11 23:14:49',	'2023-06-23 10:10:49',	'MELE BAY',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'MELE BAY',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(423,	'\"BEACH CLUB\"',	'beach-club',	1,	2,	55,	NULL,	NULL,	158448336.00,	'This stunning exclusive waterfront residence positioned in Paradise Cove, Pango, among other prestigious homes, is now available for purchase.\r\n\r\nThe property features a \'Beach Club\' vibe with stunning beach areas and a sunset deck. Picture in your mind waterfalls, a lovely well-thought tropical garden with a palm collection, a massage bureau, an exquisite outdoor bathroom retreat, vast entertaining areas with an inground pool, beach hut, outdoor BBQ kitchen, and of course, a beautiful house. This property has it all!\r\n\r\nWith a deep water large yacht mooring out the front and excellent snorkelling, there truly is something for everyone in this tropical island oasis.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681215414_64354fb671c21.jpg',	'active',	0,	'no',	0,	26,	0,	NULL,	'2023-04-11 23:16:54',	'2023-06-23 20:54:45',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	NULL,	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
(424,	'SURFERS PARADISE',	'surfers-paradise',	1,	2,	55,	NULL,	NULL,	35431164.00,	'Surfers Paradise/Brand New beach house.\r\nSurfers Paradise/Brand New beach house.\r\n\r\nWhen you enter Eratap Point Estate, the feeling is tranquil; a small private beachside estate overlooks Eratap Island with crystal clear water, and a small surf breaks off to the side.\r\n\r\nThe property is a little way up on the left-hand side of the road, set back from the beach in an elevated position to enjoy the breeze and views.\r\n\r\nTo either side of the garage, the current vendors have left the two lower floor areas as a \"blank canvas\" to enable the new owners to develop the property further as they wish, maybe with an additional downstairs living open kitchen, whichever their desire is.\r\n\r\nThe main living area is on the first floor, accessed through a wooden staircase to the left-hand side of the house.',	'+678 7799252',	1,	1,	'sam@iproperty.vu',	NULL,	'uploads/addss_image/1681271466_64362aaa9fe7c.jpg',	'active',	1,	'yes',	0,	41,	0,	NULL,	'2023-04-12 14:51:06',	'2023-06-23 03:18:12',	'ERATAP POINT ESTATE',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'residential',	NULL,	'sqft',	'ERATAP POINT ESTATE',	'total price',	NULL,	NULL,	NULL,	NULL,	NULL),
