(432,	'Data Entry Officer',	'data-entry-officer',	1,	10,	NULL,	NULL,	NULL,	NULL,	'The TVET Sector Strengthening Program facilitates the delivery of skills training by local training and business development providers in Sanma and Malampa provinces. As part of the program, all trainees complete questionnaires to provide important information for the program\'s monitoring and evaluation (M&E). Working under the guidance of the\r\n\r\nprogram\'s M&E officer, this position will work on a casual basis to complete data entry of baseline and follow-up questionnaires for all program particpants from Sanma and Malampa provinces. The role will be based in Luganville, Santo for an initial period of one month commencing in early January. An extension of the position for additional\r\n\r\nmonths is a possibility.',	'01770802187',	1,	1,	'info@everisamting.com',	NULL,	NULL,	'active',	0,	'no',	0,	28,	0,	NULL,	'2023-04-12 15:38:25',	'2023-06-18 07:36:20',	'uganville,Santo, Vanuatu',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'321',	NULL,	150,	NULL,	'2',	'Masters / MBA',	40000,	60000,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Full Time',	NULL),
