(12800,	'LifeChanger Christian College',	'lifechanger-christian-college',	1,	'[\"2316\",\"2404\",\"2458\"]',	NULL,	'Our work in Vanuatu began in 1987, with the vision of our founders to evangelise unreached communities and minister in existing churches across the islands. They also built a substantial home base for community assistance and gospel outreach in the remote north of Tanna Island. \r\nToday, our work primarily involves education (Christian Schools), ongoing community assistance projects, disaster relief, and major public Christian events. All is done openly in Jesus’ name, and in partnership with local churches and other community groups, with our eyes set on a brighter future for the people of Vanuatu!',	'office@ccsv.info',	'+678 552 0202',	NULL,	'https://lh5.googleusercontent.com/p/AF1QipOhO5YOObor3fv_X-WGfoYJhi03xX9cYSZJ5DkX=w122-h92-k-no',	'active',	0,	12,	'2023-04-01 19:15:28',	'2023-05-15 10:05:00',	'872V+53W, Rte to Mele, Port Vila, Vanuatu',	'https://maps.google.com/?q=-17.6995093,168.2927014',	'',	'Salili',	5,	'-17.6995093',	'168.2927014',	'',	'',	'',	'https://search.google.com/local/reviews?placeid=ChIJ9wCQLv5fiW4RnBlVM-dUP0s&q=Schools+in+Vanuatu,+Oceania&authuser=0&hl=en&gl=US',	'1',	'5',	'https://www.libertypeople.com.au/?fbclid=IwAR3cUqsWIDUfcIt_-R5JS7t_0M9_bV3vnv6cvet7AOpmZ50r6JN5Enj1Avk',	'https://www.google.com/search?kgmid=/g/11dyxzkjgq&kponly'),
