(12829,	'Malvanua Island Beach House',	'malvanua-island-beach-house',	1,	'[\"2294\",\"2319\",\"2406\"]',	NULL,	'Malvanua Island Beach House is on a private island just off the East Coast of Espiritu Santo. The owners live on the opposite side of the 25 acre island so it feels like you have the place to yourselves.\r\nThe house is new and has two double bedrooms opening onto the beach, each with en-suite shower room. There is a central living/dining area with fully fitted kitchen and large covered deck, all just metres from the sea. Ideal for a family of four or for two couples, for honeymooners looking for the ultimate secluded getaway or anyone looking for a peaceful retreat in picture-postcard tropical surroundings with the sea on the doorstep.\r\nSwimming in clear, blue water is a few steps from the deck. Turtles cruise by on a regular basis and dugongs are occasional visitors to the bay. There is spectacular snorkelling on the other side of the island, in fantastic coral gardens. Or just lie in your hammock and watch the fish jumping in the bay in front of the house.',	'test@gmail.com',	'+678 772 8844',	NULL,	'uploads/businessdirectory/1684460723_6466d4b3b168d.jpg',	'active',	0,	13,	'2023-04-01 19:15:28',	'2023-05-19 12:45:23',	'Big Bay Hwy, Vanuatu',	'https://maps.google.com/?cid=1393509857140468001',	'',	'Vanuatu',	5,	'-15.3606881',	'167.1928',	'',	'',	'',	'https://search.google.com/local/reviews?placeid=ChIJ-TxpFNVU8m4RIenc-dS9VhM&q=hotels+in+Vanuatu,+Oceania&authuser=0&hl=en&gl=US',	'5',	'5',	NULL,	'https://www.google.com/search?kgmid=/g/11b70f8ygz&kponly'),
