(12832,	'Mangoes Resort',	'mangoes-resort',	1,	'[\"2285\",\"2289\",\"2291\"]',	NULL,	'ristine, tropical gardens, privacy and pampering… it’s all waiting for you at Mangoes Resort Vanuatu.\r\nSwap city life for South Pacific serenity in child-free Vanuatu accommodation, with 29 boutique bungalows – some with their own private plunge pools. Enjoy vistas spanning the nearby lagoon, or a garden view, surrounded by swaying palms and exotic flowers. Experience Vanuatu holidays as they ought to be. Relish real connections with friendly staff who remember your name and help make your stay unforgettable.',	'mangoes@vanuatu.com.vu',	'+678 24923',	NULL,	'uploads/businessdirectory/1684465006_6466e56e08440.png',	'active',	0,	13,	'2023-04-01 19:15:28',	'2023-05-19 13:56:46',	'785F+J34, Rue De Wales, Port Vila, Vanuatu',	'https://maps.google.com/?cid=935556029072771416',	'',	'Rue De Wales',	5,	'-17.7409779',	'168.322716',	'https://sites.google.com/view/mangoes-resort/',	'',	'sites.google.com',	'https://search.google.com/local/reviews?placeid=ChIJMaLWIFlgiW4RWIlbbEDD-ww&q=resorts+in+Ambae+Island&authuser=0&hl=en&gl=US',	'65',	'4.4',	'https://www.mangoesresort.com/?fbclid=IwAR1Y8iIbNPiYu3VEqODqJLqP2f6s3uJQh-_mkGlnsfufincw-qlnVZKWoAY',	'https://www.google.com/search?kgmid=/g/12m9d3bl9&kponly'),
