(12835,	'Marine Reach Family Care Centre',	'marine-reach-family-care-centre',	1,	'[\"2381\",\"2387\",\"2404\",\"2458\"]',	NULL,	'The Family Care Centre Charitable Trust is a registered New Zealand charity. It is also registered as a Charitable Association in Vanuatu as Marine Reach Vanuatu. Marine Reach Vanuatu has a Memorandum of Understanding with the Ministry of Health of Vanuatu to assist in providing quality health care and training for the people of Vanuatu.\r\n\r\nThe Family Care Centre has been established  just outside of the capital city Port Vila in Vanuatu. This facility consist of three buildings that will allow the organization to train, empower, equip, and spiritually support local islanders in our surrounding communities.\r\n\r\nThe Family Care Centre runs a YWAM DTS every year in partner with Youth With a Mission’s DTS program.',	'info@familycarecentre.org',	'+678 558 8877',	NULL,	'uploads/businessdirectory/1684806820_646c1ca4da627.jpg',	'active',	0,	16,	'2023-04-01 19:15:28',	'2023-05-23 12:53:41',	'69PR+G4P, Teouma Valley, Port Vila, Vanuatu',	'https://maps.google.com/?cid=1182015446541132723',	'',	'Teouma Valley',	5,	'-17.7636671',	'168.3903265',	'',	'',	'',	'https://search.google.com/local/reviews?placeid=ChIJD8FE0dtjiW4Rs-MbOslcZxA&q=doctors+in+Vanuatu,+Oceania&authuser=0&hl=en&gl=US',	'2',	'5',	'https://familycarecentre.org/',	'https://www.google.com/search?kgmid=/g/11c6q8cf30&kponly'),
