(13057,	'SFAI Barrett & Partners Vanuatu',	'sfai-barrett-&-partners-vanuatu',	1,	'[\"2286\"]',	NULL,	'SFAI Barrett & Partners Vanuatu is a leading chartered accounting and consulting firm in Port Vila, Vanuatu.\r\nThe firm’s origins date back to 1971. The firm operated under the international firm of Coopers & Lybrand until September 1992 when Lindsay Barrett and Adrian Sinclair purchased the remaining equity and changed the name to Barrett & Sinclair.\r\n\r\nIn September 1995, the firm joined the international firm, BDO International, and practised as BDO Vanuatu until 2009. In 1997, the local firm of Stafford & Associates merged with the firm and Mark Stafford became a partner. In 2005, the French accounting firm of ECA became part of the firm and provided the platform to provide the firm’s services in all official languages.\r\n\r\nIn 2021 the firm said farewell to a retiring Adrian Sinclair and welcomed Melanie Spann as a partner.',	'service@bap.com.vu',	'+678 22280',	NULL,	'https://lh5.googleusercontent.com/p/AF1QipNWOoH4f6EHXkURBd3_22W5BumtKgCSohn1hsTn=w163-h92-k-no',	'active',	0,	19,	'2023-04-01 19:15:28',	'2023-05-15 10:07:30',	'1st Floor B&P House, Port Vila, Port Vila, Vanuatu',	'https://maps.google.com/?q=-17.7370941,168.3130473',	'',	'Port Vila',	5,	'-17.7370941',	'168.3130473',	'http://bap-international.com/',	'Sunday:[Closed], Monday:[8 AM-5 PM], Tuesday:[8 AM-5 PM], Wednesday:[8 AM-5 PM], Thursday:[8 AM-5 PM], Friday:[8 AM-5 PM], Saturday:[Closed]',	'bap-international.com',	'',	'',	'',	'https://bap-international.com/',	'https://www.google.com/search?kgmid=/g/11b_2pks3k&kponly'),
(13058,	'SHARPER IMAGE',	'sharper-image',	1,	'[\"2363\",\"2365\",\"2469\"]',	NULL,	'SHARPER IMAGE is established since 1991. We are now Vanuatu’s premier ONE STOP SHOP and one of the largest specialty retailers of Reprography; Stationery; Furniture; Itech;  Consumables;  Homeware and toys with more than 20 000 different products.\r\n\r\nStocking only the best brands, we stand behind every product that we sell and propose affordable prices.',	'sharper@sharperimage.vu',	'+678 24906',	NULL,	'uploads/businessdirectory/1683849393_645d80b1d2277.jpg',	'active',	0,	21,	'2023-04-01 19:15:28',	'2023-05-15 10:09:51',	'Fatumaru Bay, Port Vila, Port Vila, Vanuatu',	'https://maps.google.com/?q=-17.7318098,168.3116544',	'',	'Port Vila',	5,	'-17.7318098',	'168.3116544',	'http://www.sharperimage.vu/',	'Sunday:[Closed], Monday:[7:30-11:30 AM], Tuesday:[7:30-11:30 AM], Wednesday:[7:30-11:30 AM], Thursday:[7:30-11:30 AM], Friday:[7:30-11:30 AM], Saturday:[8 AM-12 PM]',	'sharperimage.vu',	'https://search.google.com/local/reviews?placeid=ChIJh5JzomhgiW4RC4ZsCkoN9N0&q=Furniture+stores+in+Vanuatu,+Oceania&authuser=0&hl=en&gl=US',	'3',	'4.7',	'https://www.sharperimage.vu/',	'https://www.google.com/search?kgmid=/g/11c2qn0ql5&kponly'),
