(13072,	'South Pacific Memories',	'south-pacific-memories',	1,	'[\"2291\",\"2299\",\"2315\"]',	NULL,	'South Pacific Memories is the oasis we search for when we are traveling; the perfect spot to unwind, relax, explore and recharge, while making everlasting memories.\r\n\r\nSouth Pacific Memories is a small family owned resort, fifteen minutes from the town center, at a calm and quiet beach at the Pango peninsula, overlooking the entrance to the harbor of Port Vila.\r\n\r\nThe resort is brand new, built during the strange years of 2020 and 2021, and ready to receive you in March 2022. The four bungalows have their veranda and a roof terrace for your private star-gazing night. Ask, and we will equip your roof space with hammocks or a fire pit.\r\n\r\nThe main house has the intimate restaurant and our shared green tree-top Cathedral overlooking the swimming pool and the beach, and will always offer you a nice breeze. Here is where we start our day with a fresh breakfast, deciding what suits your needs and wishes for the day.',	'hello@southpacificmemories.com',	'+678 560 0752',	NULL,	'uploads/businessdirectory/1684202083_6462e263a6bb7.jpg',	'active',	0,	9,	'2023-04-01 19:15:28',	'2023-05-16 12:54:43',	'Angelfish Cove Road, Pango, Port Vila, Vanuatu',	'https://maps.google.com/?cid=9192871851615633531',	'',	'Port Vila',	5,	'-17.7667395',	'168.2727565',	'http://www.southpacificmemories.com/',	'',	'southpacificmemories.com',	'https://search.google.com/local/reviews?placeid=ChIJmxc9xSlfiW4Re8A8PT6kk38&q=Scuba+diving+in+Efate+Island&authuser=0&hl=en&gl=US',	'18',	'5',	'https://southpacificmemories.com/',	'https://www.google.com/search?kgmid=/g/11rfnbwlyb&kponly'),
