(13077,	'SPWWII Museum Development Office',	'spwwii-museum-development-office',	1,	'[\"2303\",\"2410\"]',	NULL,	'From crystal clear seas where Tales of the South Pacific was born. Where three American President’s served their country – along with the with the First Lady of another. And the derring-do of young aviators, soldiers and sailors would become the thing of legends, comes a wartime history many have long forgotten and many more never knew existed.\r\n\r\nBase Button on Espiritu Santo in Vanuatu, grew from nothing on a quiet, peaceful island – known more for its coconut plantations than bomber bases and stevedoring – into the largest military base in the South Pacific, playing host to over 500,000 service men and women throughout World War II.\r\n\r\nWe’re now sharing that history with the very descendants of those who supported the Allied war effort in the Pacific. With our plans to expand  into a new world class museum building, our dream is coming alive to commemorate, preserve and pass on the amazing history of what was then known as New Hebrides, to new generations of Ni-Vanuatu and visitors from around the world.',	'info@southpacificwwiimuseum.com',	'+678 553 7000',	NULL,	'uploads/businessdirectory/1684275385_646400b9c046c.jpg',	'active',	0,	12,	'2023-04-01 19:15:28',	'2023-05-17 09:16:48',	'Unity Park, Main Street, Luganville, Espiritu Santo, Vanuatu',	'https://maps.google.com/?q=-15.5155545,167.173207',	'',	'Luganville',	5,	'-15.5155545',	'167.173207',	'https://southpacificwwiimuseum.com/',	'Saturday:[Closed], Sunday:[Closed], Monday:[8 AM-5 PM], Tuesday:[8 AM-5 PM], Wednesday:[8 AM-5 PM], Thursday:[8 AM-5 PM], Friday:[8 AM-5 PM]',	'southpacificwwiimuseum.com',	'https://search.google.com/local/reviews?placeid=ChIJaRm2k-n98m4R_eeGG_ZReoA&q=Museums+in+Vanuatu,+Oceania&authuser=0&hl=en&gl=US',	'14',	'4.3',	'https://southpacificwwiimuseum.com/',	'https://www.google.com/search?kgmid=/g/11f15cy92v&kponly'),
(13078,	'SS président coolidge',	'ss-président-coolidge',	1,	'[\"2303\"]',	NULL,	'SS President Coolidge was an American luxury ocean liner that was completed in 1931. She was operated by Dollar Steamship Lines until 1938, and then by American President Lines until 1941. She served as a troopship from December 1941 until October 1942, when she was sunk by mines in Espiritu Santo in the New Hebrides at the Espiritu Santo Naval Base, part of current-day Vanuatu. President Coolidge had a sister ship, SS President Hoover, completed in 1930 and lost when she ran aground in a typhoon in 1937.',	'test@gmail.com',	'1111',	NULL,	'uploads/businessdirectory/1684276683_646405cb914ea.jpg',	'active',	0,	16,	'2023-04-01 19:15:28',	'2023-05-17 09:38:03',	'F6GP+84, Luganville, Vanuatu',	'https://maps.google.com/?cid=2769045612030334287',	'',	'Luganville',	5,	'-15.524167',	'167.235278',	'',	'',	'',	'',	'',	'',	NULL,	'https://www.google.com/search?kgmid=/g/11trgc7ckz&kponly'),
