(13313,	'Vunausi Conservation & Enviromental Organisation',	'vunausi-conservation-&-enviromental-organisation',	1,	'[\"2404\",\"2458\"]',	NULL,	'The Vunausi Environmental Conservation Organization (VECO) is an NGO of South Santo in SANMA province in Vanuatu initiated on the 9th of May of 2013 on Tangoa Island with an executive body and representing community members involved in Environmental Conservation activities in the communities. The Vunausi area is composed with unique combination of land features; Forest resources, Water Catchment area, Streams and River, Estuaries, Coastal area and offshore islands. VECO was formally registered under the Vanuatu Financial Service Commission Service (VFSC) on 27th August 2015 and on the 22nd December of 2015 formally paid its annual fee as member of the National Non-Government Organization, Vanuatu Non-Government Organization (VANGO). VECO has a Bank Account with the local Westpac Branch in Port Vila, Vanuatu. VECO now seeks funds on voluntary and to support the local community of South Santo to care for the Environment through Educational Awareness and Participatory Sustainable Management of the Natural Resources and Conservation of the Biodiversity of South Santo.',	'veco.information@gmail.com',	'+679 741 3711',	'+679 514 2046',	'https://lh5.googleusercontent.com/p/AF1QipPQsNP6ie444KVQtW63zuoZoQbNnYC0pNC6cmKX=w143-h92-k-no',	'active',	0,	22,	'2023-04-01 19:15:28',	'2023-05-15 10:07:51',	'Barangah South Santo, Vanuatu',	'https://maps.google.com/?q=-15.5777804,167.0015888',	'',	'Vanuatu',	5,	'-15.5777804',	'167.0015888',	'https://veco-official.blogspot.com/',	'',	'veco-official.blogspot.com',	'https://search.google.com/local/reviews?placeid=ChIJKV3hAAPw8m4RTOL6Vt2dEOo&q=Tourist+Attractions+in+Santo+Island&authuser=0&hl=en&gl=US',	'1',	'5',	'https://veco-official.blogspot.com/',	'https://www.google.com/search?kgmid=/g/11f54km089&kponly'),
(13314,	'Wai Melmelo Guest House',	'wai-melmelo-guest-house',	1,	'[\"2289\",\"2315\",\"2319\"]',	NULL,	'Waimelmelo Guest House, suitable for budgeted travellers and backpackers who look for cheaper room rates and love to go out sightseeing our beautiful islands. We are located close to supermarkets, local market for vegetables, bakery and nearby mini shops. It is 5-10 minutes walk to Port Vila town. Our rooms are in variety of dormitory (4 sharing), twin standard, double and bungalows.',	'test@gmail.com',	'+678 27038',	NULL,	'uploads/businessdirectory/1684106890_64616e8a1e131.jpg',	'active',	0,	23,	'2023-04-01 19:15:28',	'2023-05-15 10:28:10',	'Fresh Water 1, P O Box 1622, TEL:(678)27038, Port Vila, Vanuatu',	'https://maps.google.com/?q=-15.350410590573,167.25173942412',	'',	'Port Vila',	5,	'-15.350410590573',	'167.25173942412',	'',	'',	'',	'https://search.google.com/local/reviews?placeid=ChIJ82Y1DUNgiW4Ry3qrHSXMV_U&q=Hotels+in+Efate+Island&authuser=0&hl=en&gl=US',	'1',	'1',	NULL,	'https://www.google.com/search?kgmid=/g/11g8bws0h1&kponly'),
(13315,	'Walaha Airport',	'walaha-airport',	1,	'[\"2331\"]',	NULL,	'Walaha Airport is a small airport in Penama, Vanuatu. The airport is located at latitude -15.41200 and longitude 167.69099. The airport has one runway: 16/34. The ICAO airport code of this field is NVSW. The airport\'s IATA code is WLH. Nearby other airfields are Redcliffe Airport, Longana Airport, Sara Airport, Santo Pekoa International Airport and Maewo-Naone Airport.\r\n\r\nWalaha Airport does not publish a METAR, the nearest weather station is Santo Pekoa International Airport, which is 52 km away. The flight information region (FIR) is Nadi East.\r\n\r\nWalaha Airport is in the timezone of Pacific/Efate. Difference with UTC is +11 h. Today the sun rises at 06:03 and sets at 17:28. This applies to Walaha Airport, the universal daylight period may be different. The difference between the local time and UTC is +11 hour. Daylight saving time is currently in progress.',	'test@gmail.com',	'1111',	NULL,	'uploads/businessdirectory/1684108208_646173b07a287.jpg',	'active',	0,	22,	'2023-04-01 19:15:28',	'2023-05-15 10:50:08',	'HMPR+7GC, Walaha, Ambae, Vanuatu',	'https://maps.google.com/?q=-15.4143107,167.6912572',	'',	'Walaha',	5,	'-15.4143107',	'167.6912572',	'',	'',	'',	'',	'',	'',	NULL,	'https://www.google.com/search?kgmid=/m/02q0ndl&kponly'),
(13316,	'Wan Smol Bag Theatre',	'wan-smol-bag-theatre',	1,	'[\"2404\",\"2458\",\"2465\"]',	NULL,	'Wan Smolbag Theatre is a non-government organisation based in Vanuatu, but operating all over the South Pacific. Wan Smolbag Theatre is primarily a development theatre group aiming to create awareness and engagement with issues surrounding education, health, governance, the environment, youth and gender.',	'info@wansmolbag.org',	'+678 27119',	NULL,	'uploads/businessdirectory/1684109253_646177c5acdc7.jpg',	'active',	0,	21,	'2023-04-01 19:15:28',	'2023-05-15 11:07:33',	'Wan Smolbag Haos, Tagabe, Port Vila, Vanuatu, Port-Vila, Vanuatu',	'https://maps.google.com/?cid=7797641989034915411',	'',	'Rte to Mele',	5,	'-17.70566',	'168.307394',	'http://visit.wansmolbag.org/',	'Sunday:[Closed], Monday:[8 AM-4:30 PM], Tuesday:[8 AM-4:30 PM], Wednesday:[8 AM-4:30 PM], Thursday:[8 AM-4:30 PM], Friday:[8 AM-4:30 PM], Saturday:[Closed]',	'visit.wansmolbag.org',	'https://search.google.com/local/reviews?placeid=ChIJdQZ_ABtgiW4RU7YYShPKNmw&q=theaters+in+Vanuatu,+Oceania&authuser=0&hl=en&gl=US',	'2',	'5',	'https://www.wansmolbag.org/',	'https://www.google.com/search?kgmid=/g/1q2w1k7bz&kponly'),
