(13318,	'War Horse Saloon',	'war-horse-saloon',	1,	'[\"2293\",\"2307\",\"2311\",\"2425\",\"2466\"]',	NULL,	'The Warhorse Saloon is a sports bar and restaurant located on the wharf road in Port Vila, Vanuatu.  Locals love catching up here for some of the coldest beer and best coffee around town. Visitors on a cruise often find it a perfect stop in on the way back to the ship. Warhorse Saloon is the place for watching or playing sports and competitions in Port Vila.  We have Darts, Pool and Karaoke, and show all major sporting events on our big screen TVs.  There is always something happening at the Warhorse, so come in and have a ice cold drink and a hot meal with us.',	'info@warhorsesaloonvanuatu.com',	'+678 26670',	NULL,	'uploads/businessdirectory/1684111506_646180922c2cc.jpg',	'active',	0,	21,	'2023-04-01 19:15:28',	'2023-05-15 11:45:06',	'Wharf Rd, Port Vila, Vanuatu',	'https://maps.google.com/?cid=810213614007729160',	'',	'Port Vila',	5,	'-17.7562894',	'168.3141605',	'http://warhorsesaloonvanuatu.com/',	'Saturday:[11:30 AM-10 PM], Sunday:[11:30 AM-10 PM], Monday:[11:30 AM-10 PM], Tuesday:[11:30 AM-10 PM], Wednesday:[11:30 AM-10 PM], Thursday:[11:30 AM-10 PM], Friday:[11:30 AM-10 PM]',	'warhorsesaloonvanuatu.com',	'https://search.google.com/local/reviews?placeid=ChIJrSBs4iHgi24RCLwdP_10Pgs&q=Restaurants+in+Vanuatu,+Oceania&authuser=0&hl=en&gl=US',	'81',	'4',	'http://warhorsesaloonvanuatu.com/',	'https://www.google.com/search?kgmid=/g/11gzlcsnc&kponly'),
(13319,	'Warwick Le Lagon - Vanuatu',	'warwick-le-lagon---vanuatu',	1,	'[\"2289\",\"2291\",\"2307\"]',	NULL,	'Warwick Le Lagon – Vanuatu is a vibrant, 4.5 star family-friendly luxury resort located on the shores of Erakor Lagoon in Port Vila (Vanuatu). A true tropical paradise of cascading waters and lush gardens with inviting pathways set amid peaceful surroundings – yet close enough to town to make it easy to explore and adventure beyond the resort. Spend your days relaxing by the pool or beach, or indulge your senses at our day spa. Offering Kids Club for the little ones, water sports and many other resort activities the Warwick Le Lagon-Vanuatu is the ultimate private oasis.\r\n\r\nPampering and personalized service permeate every aspect of your stay. Choose from luxurious rooms with garden or lagoon views, standalone bungalows , or exclusive villas in the South Pacific.  Featuring a variety of restaurants and bars as well as a large conference centre and onsite meeting rooms, Warwick Le Lagon – Vanuatu is the perfect location for your next event. And, of course, it’s a dream venue for unforgettable destination weddings and honeymoons.',	'info.lelagon@warwickhotels.com',	'+678 22313',	NULL,	'uploads/businessdirectory/1684113004_6461866c79428.jpg',	'active',	0,	39,	'2023-04-01 19:15:28',	'2023-05-15 12:10:04',	'Warwick Le Lagon Resort & Spa, Elluk Road, Off Kumul Highway, Erakor Lagoon, Port Vila, Vanuatu',	'https://maps.google.com/?cid=15730088880629873015',	'',	'Erakor Lagoon',	5,	'-17.76755899999999',	'168.309609',	'https://www.warwickhotels.com/warwick-le-lagon-vanuatu/?utm_source=google&utm_medium=local&utm_campaign=seo',	'',	'warwickhotels.com',	'https://search.google.com/local/reviews?placeid=ChIJE2CSyF5giW4Rd_lDz36ATNo&q=resorts+in+Ambae+Island&authuser=0&hl=en&gl=US',	'287',	'4',	'https://www.warwickhotels.com/warwick-le-lagon-vanuatu/?utm_source=google&utm_medium=local&utm_campaign=seo',	'https://www.google.com/search?kgmid=/g/1v7pyp07&kponly'),
(13320,	'Waterfront Bar and Grill',	'waterfront-bar-and-grill',	1,	'[\"2293\",\"2307\"]',	NULL,	'The Waterfront Bar and Grill is a popular and much loved South Pacific dining experience. Opened in 1980 our waterfront restaurant has enticed diners with panoramic Port Vila harbour views and delicious food for over 40 years. Recently upgraded, our relaxed vibe and friendly service remain the same.  Join us for a cocktail and a meal under our authentic Natangura thatched roof and enjoy the melodies of local musicians and the beautiful views over the bay.\r\n\r\nOpen for Lunch and Dinner 7 days a week, the Waterfront Bar & Grill is the perfect spot for an intimate dinner date, a family feast or a birthday bash.\r\n\r\nFor bookings over 20 please email us.\r\n\r\nWe also cater for bigger events such as weddings, corporate functions and presentation dinners.',	'waterfrontbargrill@live.com',	'+678 23490',	NULL,	'https://lh5.googleusercontent.com/p/AF1QipMcV7VFLoiadIFDr9rYdtZxwk6RKOoqcfoCzs0s=w122-h92-k-no',	'active',	0,	23,	'2023-04-01 19:15:28',	'2023-05-16 09:23:55',	'Port Vila, Port Vila, Vanuatu',	'https://maps.google.com/?cid=3985981058349094475',	'',	'Port Vila',	5,	'-17.7438799',	'168.3137484',	'https://waterfrontbarandgrillportvila.com/',	'Saturday:[11:30 AM-2:30 PM], Sunday:[11:30 AM-2:30 PM], Monday:[11:30 AM-2:30 PM], Tuesday:[11:30 AM-2:30 PM], Wednesday:[11:30 AM-2:30 PM], Thursday:[11:30 AM-2:30 PM], Friday:[11:30 AM-2:30 PM]',	'waterfrontbarandgrillportvila.com',	'https://search.google.com/local/reviews?placeid=ChIJXQyHJmBgiW4RS1ZVaKcMUTc&q=Restaurants+in+Vanuatu,+Oceania&authuser=0&hl=en&gl=US',	'130',	'3.8',	'https://waterfrontbarandgrillportvila.com/',	'https://www.google.com/search?kgmid=/g/1tfp_0kf&kponly'),
