(13323,	'Watersports Port Vila',	'watersports-port-vila',	1,	'[\"2281\"]',	NULL,	'Discover Vanuatu and its pristine marine environment with us. From the relaxed to the rushed, chase the fun and make the most of your holiday in this beautiful harbour. You can choose from our tour menu below.\r\nReef Explorer: our semi submarine, get below the waterline and see another world.\r\nSnorkel Adventure: Dive in and explore the reef at your own leisure.\r\nThe Haa Bar: Cruise Port Vila Harbour on the Haa Bar, our unique little tiki bar on the water.\r\nSunset Cruise: The Haa Bar will take you out to enjoy the sunset with a cold drink.\r\nJet Skis: Race ya mates to Hideaway Island and back.\r\nVanuatu Jet: The Ultimate Rush in our powerful jet boats, 360 spins and sideways slides\r\nAll our tours are guided by friendly local Ni Vanuatu Guides',	'vanuatuwatersports@gmail.com',	'+678 772 4354',	NULL,	'uploads/businessdirectory/1684191976_6462bae870411.png',	'active',	0,	16,	'2023-04-01 19:15:28',	'2023-05-16 10:06:16',	'Nambawan cafe, Port Vila, Vanuatu',	'https://maps.google.com/?cid=14585302906333668692',	'',	'Port Vila',	5,	'-17.7371822',	'168.3123809',	'https://watersports-port-vila.business.site/?utm_source=gmb&utm_medium=referral',	'Saturday:[Closed], Sunday:[Closed], Monday:[9 AM-6 PM], Tuesday:[9 AM-6 PM], Wednesday:[9 AM-6 PM], Thursday:[9 AM-6 PM], Friday:[9 AM-6 PM]',	'business.site',	'https://search.google.com/local/reviews?placeid=ChIJL3yPaTlhiW4RVKV9kbdnaco&q=snorkeling+in+Vanuatu,+Oceania&authuser=0&hl=en&gl=US',	'9',	'5',	'https://watersportsportvila.com/',	'https://www.google.com/search?kgmid=/g/11s3y09322&kponly'),
(13324,	'Waves at Surfside',	'waves-at-surfside',	1,	'[\"2285\",\"2289\",\"2299\",\"2315\",\"2406\"]',	NULL,	'aves at Surfside offer spacious 3 and 4 bedroom beachside Villas on Pango Surf Beach in Vanuatu. It is the Perfect holiday accommodation for you, your family or your group.\r\n\r\nOur spacious Villas are elegantly presented, with high quality furnishings, large bedrooms with King Size beds, your own private swimming pool and a view of the ocean from your bed.\r\n\r\nPango surf break is one of the prime surf beaches in Vanuatu and the Leimalo Surfing Competition is held at Pango yearly.\r\n\r\nBeing adjacent to Pango Village there are local buses at the door that can take you into Port Villa, supermarkets, or any number of restaurants in the area all within a 10 minute ride.\r\n\r\nWhat more could you want from your Vanuatu Holiday?',	'info@wavesatsurfside.com',	'+678 530 5868',	NULL,	'uploads/businessdirectory/1684193439_6462c09f608c3.png',	'active',	0,	20,	'2023-04-01 19:15:28',	'2023-05-16 10:30:39',	'67FR+9Q6, Pango Rd, Port Vila, Vanuatu',	'https://maps.google.com/?cid=8103855610597448573',	'',	'Pango Rd',	5,	'-17.7765959',	'168.2918898',	'http://wavesatsurfside.com/',	'',	'wavesatsurfside.com',	'https://search.google.com/local/reviews?placeid=ChIJMWquYx1eiW4RfZu35L2tdnA&q=resorts+in+Ambae+Island&authuser=0&hl=en&gl=US',	'4',	'3.8',	'https://wavesatsurfside.com/',	'https://www.google.com/search?kgmid=/g/11f3xg1wq5&kponly'),
