(13326,	'Waves on Bukura',	'waves-on-bukura',	1,	'[\"2285\",\"2292\",\"2299\",\"2315\",\"2406\"]',	NULL,	'Waves on Bukura is a small retreat of only 3 villas on Bukura Beach.We have our own whitesand beach with an inter-tidal reef with a blue hole as well as a BBQ beachhut and inground saltwater pool.We are a bed and breakfast / maison d\'hotes where we try to offer our guests a more relaxed and peronalised view of Port Vila and surrounds.We offer comfortable spacious 1 bedroom villas with a range of dining options, cook for yourselves in your villa kitchen or in our BBQ beachhut, or let us pamper you with a lovely \"french cuisine\" home-stay dinner.',	'wavesonbukura@gmail.com',	'+678 774 3733',	NULL,	'https://lh5.googleusercontent.com/p/AF1QipOmMPK90Oup-VYn8y365YCDIgeNeRqIAYiVKevm=w163-h92-k-no',	'active',	0,	14,	'2023-04-01 19:15:28',	'2023-05-16 12:34:01',	'76Q9+G6G, Devil\'s Point Road Vila, Matao Tiupeniu, Vanuatu',	'https://maps.google.com/?cid=8875981198164451423',	'',	'Devil\'s Point Road Vila',	5,	'-17.7111991',	'168.2180707',	'',	'',	'',	'',	'',	'',	'https://www.facebook.com/wavesonbukura',	'https://www.google.com/search?kgmid=/g/1pp2t_b8x&kponly'),
