(13332,	'White Grass Ocean Resort & Spa',	'white-grass-ocean-resort-&-spa',	1,	'[\"2285\",\"2291\",\"2299\",\"2315\",\"2406\"]',	NULL,	'Tanna Island languishes in the blue waters of the South Pacific.  Stunning White Grass Ocean Resort is a haven for even the most weary traveller, as a guest can stay in this idyllic location to laze away many hours under a shady palm or take a dip in the sea.\r\n\r\nFourteen individual bures have sea views and lie within the manicured gardens of White Grass Ocean Resort. Each has unique decorative elements which reflect the distinctive South Pacific locale, yet incorporates the comforts of hot water showers in en-suite bathrooms, ceiling fans, bed canopy nets, and private balconies. \r\n\r\nBures are available for singles and couples as well as family bures accommodating up to four people. Within the resort there is direct access to reef edge snorkeling or inner reef pools, a swimming pool, restaurant, pitch ‘n putt golf course, petanque field, guest library, and massage hut, making the resort your idyllic home away from home.\r\n\r\nTours:\r\nWe offer the following tours: Mt Yasur Volcano & Highland Safari, Lowinio Kustom Village, Black Magic and Kava Tasting, Tanna Highlights, Louniel Surf Beach and Waterfall Safari\r\n\r\nRestaurant\r\nThe restaurant and terrace takes in magnificent sea vistas and breathtaking sunsets. Guests can relax at the bar or on the terrace and enjoy locally produced cuisine prepared from ingredients from the local waters, gardens, and farms.\r\n\r\nNabisa Day Spa\r\nEnjoy a relaxing massage or treatment in our private ocean front massage bure to fully unwind. \r\n\r\nVolcano Island Divers\r\nPADI Dive Centre - boat and shore dives available and dive courses',	'info@whitegrasstanna.com',	'+678 30010',	NULL,	'uploads/businessdirectory/1684274373_6463fcc50c4ea.jpg',	'active',	0,	25,	'2023-04-01 19:15:28',	'2023-05-17 08:59:33',	'Saltwater Rd, Lenakel, Vanuatu',	'https://maps.google.com/?cid=13378096925880586358',	'',	'Lenakel',	5,	'-19.441433',	'169.224922',	'http://www.whitegrasstanna.com/',	'',	'whitegrasstanna.com',	'https://search.google.com/local/reviews?placeid=ChIJ9zQXxXTwh24RdpDbHUaMqLk&q=Tours+in+Tanna+Island&authuser=0&hl=en&gl=US',	'89',	'4.3',	'https://www.whitegrasstanna.com/',	'https://www.google.com/search?kgmid=/g/1pp2x9x75&kponly'),
(13333,	'Wilco Hardware',	'wilco-hardware',	1,	'[\"2380\"]',	NULL,	'CNBMI Vanuatu Limited is jointly funded by China National Building Material Investment Company Limited and CNBMI Logistics Company Limited. It was incorporated in Vanuatu in 2015 by acquiring the largest building materials supermarket in Vanuatu – Wilco Limited. Now, Wilco Limited directly belongs to CNBMI and is one of the important members of its oversea chain businesses, mainly distributed in Papua New Guinea, Zambia and other country.\r\n\r\n\r\nWilco Limited is located in Port Vila and Luganville, Espiritu Santo. We have three branches, selling wide range of building materials, plumbing, power tools, fitness equipment, household products and a lot more. Considered as one of the largest hardware in Vanuatu, Wilco supplies over 10,000 products. We are serving over 60% of Vanuatu’s population with best brands, quality and prices. Our reliable and customer friendly 138 employees are set to serve you with a smile.',	'enquiryvila01@cnbmwilco.com',	'+678 22385',	NULL,	'uploads/businessdirectory/1684275707_646401fbc95e8.png',	'active',	0,	26,	'2023-04-01 19:15:28',	'2023-05-17 09:21:47',	'Champagne Estate, Port-Vila, Vanuatu',	'https://maps.google.com/?q=-17.7317754,168.3194702',	'',	'Vanuatu',	5,	'-17.7317754',	'168.3194702',	'http://www.wilco.com.vu/',	'Saturday:[7:30 AM-12 PM], Sunday:[Closed], Monday:[7:30 AM-5 PM], Tuesday:[7:30 AM-5 PM], Wednesday:[7:30 AM-5 PM], Thursday:[7:30 AM-5 PM], Friday:[7:30 AM-5 PM]',	'wilco.com.vu',	'https://search.google.com/local/reviews?placeid=ChIJIz22JENgiW4RtzVYYiPbyEU&q=Clothing+boutiques+in+Vanuatu,+Oceania&authuser=0&hl=en&gl=US',	'14',	'4.4',	'https://www.wilco.com.vu/',	'https://www.google.com/search?kgmid=/g/11c6134qk1&kponly'),
