(13360,	'Mariner Apartments',	'mariner-apartments',	6,	'[\"2285\",\"2289\",\"2290\",\"2294\",\"2346\",\"2362\",\"2406\"]',	NULL,	'Mariner Apartments balance the hospitality of an intimate and boutique style, with comfortable living in a fully appointed serviced apartment, an ideal solution for either short or extended stays. Every apartment unit is stylishly finished with natural fabrics &calming hues reflecting a unique natural ambience.\r\n\r\nMariner Apartments also provide personalized resident services.Residents at Mariner Apartments enjoy our fully-furnished spacious air-conditioned guestrooms, modern facilities, quality finishes, in room internet and WIFI access, fully equipped kitchens, contemporary bathrooms, cosy couch settee, dining area, floor-to-ceiling sliding glass door leads to either own balcony or oversized terrace with sitting area providing a panoramic view of Port Vila’s Harbour and Irriki Island, adult and children swimming pool facing the ocean and natural rock wall to maximize the comfort during your stay,\r\n\r\n​​Owner-operated Mariner Apartments offer studio apartments, 2 bedroom apartments and a penthouse suite. Mariner Apartments personalized resident services include dedicated concierge, on-site security, meticulous housekeeping, business and media services, personal shopper service, exclusive tour service, self-parking area, transfer service.\r\n\r\nMariner Apartments is perfectly located in an ideal location. Only a 5 minute walk to downtown and shopping area and within a 15 minutes drive to the airport. Either start the day by relaxing at the lovely pool or explore Vanuatu’s premier attractions and fun activities such as snorkeling, scuba diving, harbour cruises, island hopping helicopter tours, parasailing, horse riding and unique cultural ceremonies all within 5 to 15 minutes of the property.',	'reservation@mariner.vu',	'+67835189',	'+678 552 3694',	'uploads/businessdirectory/1682912291_644f34235a215.jpeg',	'active',	0,	29,	'2023-05-01 14:38:11',	'2023-05-16 10:34:54',	'Port Vila',	'https://maps.google.com/?cid=11544892825822096674',	NULL,	NULL,	NULL,	'-17.744516',	'168.314263',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'https://www.mariner.vu/',	NULL),
