(1,	'uploads/banners/V1HmW4gnJDHXfap1qiuSbY5212iMV2n8e4FftpB4.jpg',	NULL,	NULL,	'Buy, Sell, And Find Everisamting',	'购买、出售和寻找 Everisamting',	'Achetez, vendez et trouvez Everisamting',	'Купляйце, прадавайце і знайдзіце Everisamting',	'Buy, Sell, and Find Everisamting In Vanuatu! Advertise your business, or service. Look for local events, find a job, or simply turn unwanted items into vatu!',	'购买和出售从二手车到手机和电脑的一切东西，或者在世界各地寻找财产等等！',	'Achetez et vendez tout, des voitures d\'occasion aux téléphones mobiles et aux ordinateurs, ou recherchez une propriété et plus encore partout dans le monde !',	'Купляйце і прадавайце ўсё: ад патрыманых аўтамабіляў да мабільных тэлефонаў і камп\'ютараў, або шукайце нерухомасць і многае іншае па ўсім свеце!',	NULL,	NULL,	'Choose our membership plan to publish your ads with us',	NULL,	NULL,	NULL,	NULL,	'<p><strong>Everisamting Terms of Use</strong><br>&nbsp;</p><ol><li><strong>Introduction.&nbsp;</strong>Welcome to&nbsp;www.everisamting.com. Thanks for stopping by. These Terms of Use, the Privacy Policy, the Mobile Devices Terms and all policies posted on our site set out the terms on which we offer you access to and use of our site, services, applications and tools (collectively “Services”). You can find an overview of our policies&nbsp;here&nbsp;. All policies, the Mobile Devices Terms, and the&nbsp;Privacy Policy&nbsp;are incorporated into these Terms of Use. You agree to comply with the full Terms of Use when accessing or using our Services. The Terms of Use set out below take effect from 1 July 2017. A copy of the Terms of Use in effect prior to 1 July 2017 can be located&nbsp;here.</li><li><strong>Your Account.</strong>&nbsp;To access and use some of the Services, you may need to register with us and set up an account with your email address and a password (your “Account”).&nbsp;The email address you register with will be your email address, and you are solely responsible for maintaining the confidentiality of your password. You are solely responsible for all activities that happen under your Account.</li></ol><p>You may connect to the Services with a third-party service (e.g., Facebook or Google+) and you give us permission to access, store, and use your information from that service as permitted by that service and as may be described in our Privacy Policy. If you believe your Account has been compromised or misused, contact us immediately at&nbsp;Everisamting Customer Support.&nbsp;<br>&nbsp;</p><ol><li><strong>Using Everisamting.&nbsp;</strong>To use the Services, you must be over 18 years old. You agree that you will only post in relation to goods or services in Vanuatu in the appropriate category or area and you agree that you will not do any of the following bad things:</li></ol><ul><li>violate any laws or the&nbsp;Posting Rules;</li><li>post any threatening, abusive, defamatory, obscene or indecent material;</li><li>be false or misleading;</li><li>infringe any third-party right;</li><li>distribute or send communications that contain spam, chain letters, or pyramid schemes;</li><li>distribute viruses or any other technologies that may harm Everisamting, the Services or the interests or property of Everisamting users;</li><li>impose an unreasonable load on our infrastructure or interfere with the proper working of the Services;</li><li>copy, modify, or distribute any other person’s content without their consent;</li><li>use any robot spider, scraper or other automated means to access the Services and collect content for any purpose without our express written permission;</li><li>harvest or otherwise collect information about others, including email addresses, without their consent</li><li>bypass measures used to prevent or restrict access to the Services; and/or</li><li>post an ad with the intention to profit from a natural disaster, health or public safety concern, or tragic event.</li></ul><ol><li><strong>Abusing Everisamting Services.&nbsp;</strong>Everisamting and the Everisamting community work together to keep the Services working properly and the community safe. Please report problems, offensive content and policy breaches to us using the reporting system. You are solely responsible for all information that you give to Everisamting and any consequences that may result from your posts. We can at our discretion refuse, delete or take down content that we think is inappropriate or breaching these Terms of Use. We also can at our discretion restrict a user’s usage of the Services either temporarily or permanently, or refuse a user’s registration. Without limiting other remedies, we may issue warnings, limit or terminate our Services, remove hosted content and take technical and legal steps to keep users off the Services if we think that they are creating problems or acting inconsistently with the letter or spirit of our policies. However, whether we take any of these steps, we don’t accept any liability for monitoring the Services or for unauthorized or unlawful content on the Services or use of the Services by users. You also accept that Everisamting is not under any obligation to monitor any data or content which is submitted to or available on the Services. &nbsp;​​​</li><li><strong>Global Marketplace.&nbsp;</strong>Some of the Service’s features may display your ad on other sites, like on our classifieds sites, including those&nbsp;in other countries. By using the Services, you agree that your ads can be displayed on these other sites. The terms for our other sites are similar to these terms, but you may be subject to additional laws or other restrictions in the countries where your ad is posted. When you choose to post your ad to another site, you may be responsible for ensuring that it does not violate our other site policies. We may remove your ad if it is flagged on any of our sites, or if we believe it causes problems or violates any law or policy.</li><li><strong>Fees and Services.</strong>&nbsp;Using the Services is generally free. We may sometimes charge a fee for certain features or Services. If the feature you use incurs a fee, you will be able to review and accept that charge before purchase. If you choose to pause an ad at any stage, any features you have applied to your ad will not be paused. Our fees are quoted in Vanuatu Dollars, and we may sometimes change them. We’ll notify you of changes to our fees by posting the changes on the site. We may sometimes temporarily change our fees for testing purposes, promotional events or new features, these changes take effect from the time the price change is posted to the site. Our fees are non-refundable after the feature is supplied, and you are responsible for paying them when they are due. If you don’t, we may limit your ability to use the Services. If your payment method fails or your account is past due, we may collect fees owed using collection mechanisms, including third party debt collection services. Vanuatu taxes associated with our Services will be collected where applicable. &nbsp;You agree to provide accurate information necessary for Everisamting to comply with our obligations under applicable law. &nbsp;You are solely responsible for collecting and remitting any applicable taxes resulting from the sale of your items or services listed on Everisamting’s Services.</li><li><strong>Content.&nbsp;</strong>Everisamting’s Services contain content from us, you, and other users. Everisamting is protected by copyright laws and international treaties. Content displayed on or via the Services is protected as a collective work and/or compilation, pursuant to copyrights laws and international conventions. You agree not to copy, distribute the Services or modify content from the Services, our trademarks or copyrights without our express written consent. You may not disassemble or decompile, reverse engineer or otherwise attempt to discover any source code contained in the Services. Without limiting the foregoing, you agree not to reproduce, copy, sell, resell, or exploit for any purposes any aspect of the Services (other than your own content). When you give us content, including pictures, you grant us and represent that you have the right to grant us, a non-exclusive, worldwide, perpetual, irrevocable, royalty-free, sub-licensable (through multiple tiers) right to exercise any and all copyright, publicity, trademarks, design, database and intellectual property rights to that content, in any media whether now known or to be discovered in the future, including third party sites and applications. You also waive all moral rights you have in the content to the fullest extent permitted by law. We reserve the right to remove content where we have grounds for suspecting the violation of these terms or the rights of any other party.</li><li><strong>Reporting Intellectual Property Infringements (Verified Rights Owners - VeRO).&nbsp;</strong>Do not post content that infringes the rights of third parties. This includes, but is not limited to, content that infringes on intellectual property rights such as copyright and trademark (e.g. offering counterfeit items for sale). We can remove content where we have grounds for suspecting the violation of these terms, our policies or of any party’s rights. If you have a good faith belief that a listing on any of the Services infringes your copyright, trademark, or other intellectual property rights, all you need to do is download our&nbsp;Notice of Infringement (NOCI)&nbsp;&nbsp;form, fill it out, and email it to the email address in the form. Only the intellectual property rights owner can report potentially infringing items or listings through Everisamting’s VERO Program. After we receive your first NOCI, Everisamting will confirm your enrolment in our program and send you the instructions on how to submit future reports electronically. We can share, in accordance with applicable law, the completed NOCI form with the third party that originally posted the potentially infringing listing.</li><li><strong>Third Party services on Everisamting.&nbsp;</strong>You may use the PayPal payment gateway for some financial transactions on our Services. When you link your PayPal account to your Account, you can use your PayPal account to pay or be paid for items by buyers or sellers while using Everisamting’s Services. You acknowledge and agree that by utilising any third party services through our Services (such as PayPal), you are bound by the terms and conditions of that third party and we are not liable for any loss, claims or damages howsoever arising in connection with that third party’s services.</li></ol><p>If you to link your PayPal account to your Account you appoint Everisamting as your limited agent to:</p><p>a. provide to PayPal your name, address, payment amount, item details, item category, and all other information required by PayPal to enable PayPal to process payments to or from your PayPal account; and</p><p>b. receive payment confirmation and decline notices from PayPal in respect of your PayPal payment transactions.&nbsp;</p><p><br>When you link your PayPal account to your Account, we accept our appointment as your limited agent to undertake those activities specified in the paragraph above. Our appointment as your agent to undertake these activities terminates immediately upon your Account ceasing to be linked to your PayPal account.<br><br>If you have a dispute with PayPal, a buyer, or a seller, that does not arise directly as a result of an error by Everisamting, in respect of any payment transacted (or failed to be transacted) on your PayPal Account, you release us and our affiliates (and our officers, directors, agents, subsidiaries, joint ventures and employees and those of our affiliates) from any and all claims demands and damages (actual and consequential) of every kind and nature, known or unknown, arising out of or in any way connected with such disputes.<br><br>Everisamting is not able to access your complete financial details from PayPal or your PayPal account. At no time does Everisamting hold any of the funds when a buyer pays a seller using PayPal. Funds are transferred directly by PayPal from the buyer’s PayPal account to the seller’s PayPal account after the deduction by PayPal of any relevant PayPal fees. PayPal\'s terms and conditions apply to your use of PayPal when you access PayPal’s services from our Services, and you must agree to PayPal’s terms and conditions in order to use the PayPal’s services. You acknowledge and agree that, to the extent permitted by law, we are not liable to you for any loss or damage you incur arising from your use of the PayPal method, unless such loss or damage was as a direct result of Everisamting’s error, in which case our liability is limited in accordance with clause 11.<br>&nbsp;</p><ol><li><strong>Legal and Financial&nbsp;Advice</strong>. You acknowledge and agree that you have the opportunity to obtain independent legal and financial advice from appropriately qualified professional advisers and that you take into account your personal objectives, financial situation and needs before buying or selling an item via our Services.</li></ol><p>You acknowledge and agree that the information provided by Everisamting in relation to using PayPal’s services is factual in nature only and Everisamting has not provided a recommendation or statement of opinion intended to influence your decision on whether or not to use PayPal’s services and that you cannot rely on any of Everisamting’s advertising materials, terms, instructions or policies as a recommendation, statement of opinion or financial product advice.<br>&nbsp;</p><ol><li><strong>Limitation of Liability. &nbsp;</strong>Nothing in these Terms of Use (including this clause 11) excludes, restricts or modifies any rights or statutory guarantees that you may have under applicable laws that cannot be excluded, restricted or modified, including any such rights or statutory guarantees under the Vanuatu Consumer Law.</li></ol><p>To the extent that these Terms of Use are found to exclude, restrict or modify any such rights or statutory guarantees, those rights and/or statutory guarantees prevail to the extent of the inconsistency.<br><br>Services are provided “as is” and “as available”. You agree not to hold us responsible for things other users post or do. As most of the content on the Services comes from other users, we do not guarantee the accuracy of postings or user communications or the quality, safety, or legality of what is offered. Without in any way limiting the above, you understand and agree that any seller listing which utilises the \'Price Drop\' feature has been applied at the sole discretion of that specific user for their listing. Everisamting does not in any way represent, warrant or guarantee that a price displayed for any listing on the Services which uses the Price Drop feature is a genuine price reduction.<br><br>We also cannot guarantee continuous or secure access to our Services. While we will use reasonable efforts to maintain an uninterrupted service, we cannot guarantee this and, to the extent permitted by law, we do not give any promises or warranties (whether express or implied) about the availability of our Services or that the Services will be uninterrupted or error-free. Notification functionality in the Services may not occur in real time. That functionality is subject to delays beyond our control, including without limitation, delays or latency due to your physical location or your wireless data service provider’s network.<br><br>To the extent permitted by law:</p><ul><li>we are not liable for the posting of any unlawful, threatening, abusive, defamatory, obscene or indecent information, or material of any kind by a user of the Service which violates or infringes upon your rights, including without limitation any transmissions constituting or encouraging conduct that would constitute a criminal offense, give rise to civil liability or otherwise violate any applicable law.</li><li>and without limiting any rights that you may have under the Vanuatu Consumer Law, Everisamting’s liability to you for any failure by Everisamting to comply with any statutory guarantee under the Vanuatu Consumer Law is limited to Everisamting supplying the Services again or paying you the cost of having the Services supplied again.</li></ul><p>In addition, to the extent permitted by applicable law, we (including our parent, subsidiaries, and affiliates, and our and their officers, directors, agents and employees) are not liable, and you agree not to hold us responsible, for any damages or losses (including, but not limited to, loss of money, goodwill or reputation, profits, other intangible losses, or any special, indirect, or consequential damages) resulting directly or indirectly from:</p><ul><li>the content you provide (directly or indirectly) using our Services;</li><li>your use of or your inability to use our Services;</li><li>delays or disruptions in our Services;</li><li>viruses or other malicious software obtained by accessing or linking to our Services;</li><li>glitches, bugs, errors, or inaccuracies of any kind in our Services;</li><li>damage to your hardware device from the use of any Service;</li><li>the content, actions, or inactions of third parties, including items listed using our Services;</li><li>a suspension or other action taken with respect to your account for breach or these Terms of Use or our policies;</li><li>your need to modify practices, content, or behaviour, or your loss of or inability to do business, as a result of changes to these Terms of Use or our policies.</li></ul><p><br>Everisamting excludes any liability to you for any loss or damage suffered by you as a result of Everisamting failing to comply with an applicable statutory guarantee under the Vanuatu Consumer Law if you suffering such loss or damage was not reasonably foreseeable and was not directly caused by Everisamting.<br>&nbsp;</p><ol><li><strong>Indemnification.&nbsp;</strong>You will indemnify and hold harmless Everisamting and our affiliates and our and their respective officers, directors, agents and employees (each an “Indemnified Party”), from any claim made by any third party, together with any amounts payable to the third party whether in settlement or as may otherwise be awarded, and reasonable legal costs incurred by any of the Indemnified Parties, arising from or relating to your use of the Services, any alleged violation by you of the applicable terms, and any alleged violation by you of any applicable law or regulation. We reserve the right, at our own expense, to assume the exclusive defence and control of any matter subject to indemnification by you, but doing so will not excuse your indemnity obligations.</li><li><strong>Release.&nbsp;</strong>If you have a dispute with one or more Everisamting users, you release us (and our officers, directors, agents, subsidiaries, joint ventures and employees) from any and all claims, demands and damages (actual and consequential) of every kind and nature, known or unknown, arising out of or in any way connected with such disputes.</li><li><strong>Personal Information.&nbsp;</strong>By using the Services, you agree to the collection, transfer, storage and use of your personal information by us (the “data controller”) on servers located in the United States and in the European Union as further described in our&nbsp;privacy policy.</li><li><strong>Severability.&nbsp; </strong>If a provision of these Terms of Use is illegal or unenforceable in any relevant jurisdiction, it may be severed for the purposes of that jurisdiction without affecting the enforceability of the other provisions of these Terms of Use.</li><li><strong>General.&nbsp;</strong>These Terms of Use and the other policies posted on the Services set out the entire agreement between Everisamting and you, overriding any prior agreements. From 1 July 2017, this agreement is governed by the laws of New South Wales, Vanuatu. We both submit to the non-exclusive jurisdiction of the courts of New South Wales, Vanuatu. If we don’t enforce any particular provision, we are not waiving our right to do so later. If a court strikes down any of these Terms of Use, the remaining terms will survive. We may automatically assign this agreement in our sole discretion in accordance with the notice provision below (our assignment to an affiliate will not require notice). Except for notices about illegal or infringing content, your notices to us must be sent by registered mail to:</li></ol><p>Everisamting&nbsp;</p><p>PO BOX 1515</p><p>Vanuatu</p><p>&nbsp; We will send notices to you via the email address you provide, or by registered mail. Notices sent by registered mail will be deemed received five days following the date of mailing. We may update this agreement at any time, with updates taking effect when you next use the site or after 30 days, whichever is sooner. No other amendment to this agreement will be effective unless made in writing, signed by you and by us. &nbsp; Send questions, comments or complaints to&nbsp;Everisamting Customer Support.<br>&nbsp;</p><ol><li><strong>Mobile Devices Terms.&nbsp;</strong>If you’re accessing Everisamting Services from a mobile device using a Everisamting Mobile Application (the “Application”), the following terms and conditions (“Mobile Devices Terms”) apply to you in addition to the applicable Mobile Privacy and Legal Notice or End User License Agreement, as the case may be. Your use of the Application confirms your agreement to these Mobile Devices Terms.</li><li><strong>Application Use.&nbsp;</strong>Everisamting grants you the right to use the Application only for your personal use. You must comply with all applicable laws and third party terms of agreement when using the Application (e.g. your wireless data service agreement). The Application may not contain the same functionality available on the www.everisamting.com website. &nbsp;Your download and use of the Application is at your own discretion and risk, and you are solely responsible for any damages to your hardware device(s) or loss of data that result from the download or use of the Application.</li><li><strong>Intellectual Property - Applications.&nbsp;</strong>Everisamting owns, or is the licensee to, all right, title, and interest in and to its Applications, including all rights under patent, copyright, trade secret, trademark, and any and all other proprietary rights, including all applications, renewals, extensions, and restorations thereof. You will not modify, adapt, translate, prepare derivative works from, decompile, reverse-engineer, disassemble, or otherwise attempt to derive source code from any Application and you will not remove, obscure, or alter Everisamting’s copyright notice, trademarks or other proprietary rights notices affixed to, contained within, or accessed in conjunction with or by any Everisamting Application.</li><li><strong>Prohibited Countries Policy and Foreign Trade Regulation - Applications.&nbsp;</strong>Everisamting Applications or their underlying technology may not be downloaded to or exported or re-exported: (a) into (or to a resident or national of) Burma (Myanmar), Cuba, Iraq, Iran, Libya, North Korea, Sudan, Syria, or any other country subject to United States embargo; (b) to anyone on the US Treasury Department’s list of Specially Designated Nationals or on the US Commerce Department’s Denied Party or Entity List; and (c) to any prohibited country, person, end-user, or entity specified by US Export Laws. When using a Everisamting Application, you are responsible for complying with trade regulations and both foreign and domestic laws (e.g., you are not located in a country that is subject to a US Government embargo, or that has been designated by the US Government as a “terrorist supporting” country, and you are not listed on any US Government list of prohibited or restricted parties).</li><li><strong>Additional Terms.&nbsp;</strong>Additional terms and conditions that apply to you based on the mobile device the Application is installed on:</li></ol><p><strong>iOS – Apple</strong></p><p>&nbsp;</p><p>1.&nbsp;&nbsp; &nbsp;These Mobile Devices Terms are an agreement between you and Everisamting, and not with Apple. Apple is not responsible for the Application and the content thereof.</p><p>2.&nbsp;&nbsp; &nbsp;Everisamting grants you the right to use the Application only on an iOS product that you own or control and as permitted by the Usage Rules set forth in the App Store Terms of Service.</p><p>3.&nbsp;&nbsp; &nbsp;Apple has no obligation whatsoever to furnish any maintenance and support services with respect to the Application.</p><p>4.&nbsp;&nbsp; &nbsp;Apple is not responsible for the investigation, defence, settlement, and discharge of any third party intellectual property infringement claim.</p><p>5.&nbsp;&nbsp; &nbsp;Apple is not responsible for addressing any claims by you or any third party relating to the Application or your possession and/or use of the Application, including but not limited to: (a) product liability claims; (b) any claim that the Application fails to conform to any applicable legal or regulatory requirement; and (c) claims arising under consumer protection or similar legislation.</p><p>6.&nbsp;&nbsp; &nbsp;In the event of any failure of the Application to conform to any applicable warranty, you may notify Apple, and Apple will refund the purchase price, if applicable, for the Application to you; and to the maximum extent permitted by applicable law, Apple will have no other warranty obligation whatsoever with respect to the Application.</p><p>7.&nbsp;&nbsp; &nbsp;Apple and Apple’s subsidiaries are third party beneficiaries of these Mobile Devices Terms, and, upon your acceptance, Apple as a third party beneficiary thereof will have the right (and will be deemed to have accepted the right) to enforce these Mobile Devices Terms against you.</p><p>&nbsp;</p><p><strong>Windows – Microsoft</strong></p><p>&nbsp;</p><p>1.&nbsp;&nbsp; &nbsp;These Mobile Devices Terms are an agreement between you and Everisamting, not Microsoft. The terms of use and privacy policies of Microsoft and, where applicable, the network operators that provide billing services for the Windows Phone Marketplace do not apply to your use of the Application.</p><p>2.&nbsp;&nbsp; &nbsp;You may install and use one (1) copy of the Application on up to five (5) devices you personally own or control and which are affiliated with the Windows Live ID associated with your Windows Marketplace account. You may not install or use a copy of the Application on a device you do not own or control.</p><p>3.&nbsp;&nbsp; &nbsp;Microsoft, your device manufacturer, and (if applicable) your wireless carrier are not responsible for providing support services for the Application.</p><p>4.&nbsp;&nbsp; &nbsp;Microsoft, the wireless carriers over whose network the Application is distributed (if applicable), and each of their respective affiliates and suppliers (collectively, “Disclaiming Distributors”) give no express warranty, guarantee, or conditions under or in relation to the Application. To the extent permitted under your local laws, the Disclaiming Distributors exclude any implied warranties or conditions, including those of merchantability, fitness for a particular purpose, and non-infringement.</p><p>5.&nbsp;&nbsp; &nbsp;You, and not the Disclaiming Distributors, bear the risk of using the Application (even if the Disclaiming Distributors have been advised of the possibility of damages to you). You may have additional consumer rights under your local laws which these Mobile Devices Terms cannot change.</p><p>6.&nbsp;&nbsp; &nbsp;To the extent not prohibited by law, you will not seek to recover any consequential, lost profit, special, indirect, or incidental damages from any Disclaiming Distributor.</p><p>&nbsp;</p>',	'uploads/banners/mlY8h5f6UvTRamNpfPK4E75GGELDjwf5dPaXwhzi.png',	'https://youtu.be/s7wmiS2mSXY',	'<p>Welcome to everisamting.com! Our website is dedicated to providing top quality platform to buy and sell in Vanuatu.</p><p>Founded in 2023 by people here in Vanuatu, we have been serving the Vanuatu community for over 40 years in different areas. Our team is made up of highly skilled and knowledgeable individuals who are passionate about what they do.</p><p>At everisamting.com, customer satisfaction is our top priority. We strive to go above and beyond to ensure that every one of our clients is completely satisfied with their experience.</p><p>Thank you for visiting our website. We hope to have the opportunity to serve you and fulfill all of your buying and selling needs</p>',	NULL,	'<p>Privacy Policy for Everisamting</p><p>Everisamting is committed to protecting the privacy of its users. This Privacy Policy describes the types of personal information we collect and how it is used, stored, and shared when you use our app.</p><p>Information Collection and Use</p><p>We may collect personal information from you in the following ways:</p><p>Information You Provide: When you register or use Everisamting, we may ask you to provide personal information, such as your name, email address, phone number, and other relevant information.</p><p>Automatically Collected Information: We may automatically collect certain information from your device, including but not limited to your device type, operating system, browser type, IP address, and usage information.</p><p>Use of Information</p><p>We use the collected information for the following purposes:</p><p>To Provide and Improve Services: We use the information to provide and improve our services, personalize content, and respond to user inquiries and requests.</p><p>To Communicate with Users: We use the information to communicate with users about updates, promotions, and other relevant information.</p><p>To Protect Rights and Interests: We use the information to protect our rights, interests, and the rights and interests of our users, as well as to investigate and prevent fraud and other unlawful activities.</p><p>For Legal and Compliance Purposes: We use the information to comply with applicable laws, regulations, and legal processes, as well as to respond to lawful requests and legal authorities.</p><p>Information Sharing</p><p>We do not sell, trade, or rent users\' personal information to third parties. However, we may share the information with the following entities for the purposes stated above:</p><p>Service Providers: We may share the information with trusted third-party service providers who assist in operating the app, conducting business, and providing services to users.</p><p>Legal and Compliance: We may share the information with legal and regulatory authorities, as well as to respond to lawful requests and legal processes.</p><p>Security</p><p>We take appropriate measures to protect the personal information collected from users. However, please note that no security measures are perfect or impenetrable, and we cannot guarantee the absolute security of users\' personal information.</p><p>Children\'s Privacy</p><p>Everisamting does not knowingly collect personal information from children under the age of 13. If you believe that your child has provided personal information to Everisamting without your consent, please contact us immediately, and we will take steps to remove the information from our records.</p><p>Changes to Privacy Policy</p><p>We may update this Privacy Policy from time to time. Users are encouraged to review this Privacy Policy periodically for any changes. Continued use of Everisamting after the posting of changes to this Privacy Policy will constitute acceptance of the updated policy.</p><p>Contact Us</p><p>If you have any questions or concerns about this Privacy Policy, please contact us at info@everisamting.com.</p><p>By using Everisamting, you acknowledge that you have read, understood, and agreed to this Privacy Policy.</p>',	NULL,	NULL,	'info@everisamting.com',	'Port Vila, Vanuatu',	NULL,	NULL,	NULL,	NULL,	'Praesent Finibus Dictum Nisl Sit Amet Vulputate. Fusce A Metus Eu Velit Posuere Semper A Bibendum Ante. Donec Eu Tellus Dapibus, Semper Orci Eget, Commodo Lacu Praesent Ullamcorper.',	'Lorem Ipsum Dolor Sit Amet, Consectetur Adipiscing Elit. Etiam Commodo Vel Ligula.',	'Class Aptent Taciti Sociosqu Ad Litora Torquent Per Conubia Nostra, Per Inceptos Himenaeos.',	'Class Aptent Taciti Sociosqu Ad Litora Torquent Per Conubia Nostra, Per Inceptos Himenaeos.',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'<h2><strong>What is not allowed on Everisamting?</strong></h2><p><br>Updated 24th December 2022<br><br>The list below details what can\'t be posted on Everisamting in either offering or wanted ads:</p><ol><li>Alcoholic beverages</li><li>Blood, body parts and bodily fluids, or offers of humans for sale, including offers or requests for adoption or surrogacy</li><li>Burglary tools</li><li>Counterfeit products, replicas or knock-off brand name goods</li><li>Electronic surveillance equipment</li><li>Embargoed goods</li><li>Endangered or protected species, or any part of any endangered or protected species</li><li>Prostitution and escort services that offer sex, sexual favours, sexual actions or sexual services in exchange for anything</li><li>Fireworks, destructive devices and explosives</li><li>Government and transit badges, uniforms, IDs, documents and licenses</li><li>Hazardous materials including but not limited to radioactive, toxic and explosive materials</li><li>Identity documents, personal financial records and&nbsp;personal information</li><li>Illegal drugs, controlled substances, substances and items used to manufacture&nbsp;drugs and controlled substances, items designed only to help someone take drugs and drug paraphernalia</li><li>Nitrous oxide products, including but not limited to nitrous oxide canisters, bulbs, nangs and cream chargers</li><li>Illegal items and services, and items which encourage or facilitate illegal activity</li><li>Illegal telecommunication and electronics equipment such as access cards, password sniffers, radar scanners, traffic signal control devices or cable descrambler</li><li>Items issued to any Armed Force that have not been disposed of in accordance with that country\'s demilitarization policies</li><li>Lottery tickets, sweepstakes entries and slot machines</li><li>Material, pictures and images that are obscene, pornographic, adult in nature, contain nudity or are harmful to minors</li><li>Material that infringes copyright, including but not limited to software or other digital goods which you are not authorized to sell</li><li>New merchandise or services from network marketing companies, work-from-home, independent franchisees or distributors, or similar representatives</li><li>Personal information or mailing lists. We do not accept the sale of bulk email, Internet Protocol (IP), Instant Messenger (IM), or mailing lists that contain names, addresses, phone numbers, or other personal identifying information. Any tools or software designed predominantly to send unsolicited commercial messages (UCE or \"spam\") are also not permitted.</li><li>Selling or offering services for supplements/medicine general or pharmaceutical</li><li>Prescription or non-prescription drugs and devices, drugs that make false or misleading treatment claims, or treatment claims that require therapeutic goods administration \"<a href=\"http://www.tga.gov.au/\">TGA</a>\" approval</li><li>Commercial tanning units or commercial tanning services wanted or offered</li><li>Offensive material</li><li>Pesticides or hazardous materials</li><li>Plants and insects that are restricted or regulated</li><li>Recalled items, banned products or products that do not meet the mandatory product safety standards (for items recalled in Australia and information on product safety bans and mandatory standards, please visit:&nbsp;<a href=\"https://www.productsafety.gov.au/\">www.productsafety.gov.au</a>).</li><li>Stocks and other securities including Bitcoins and related mining equipment</li><li>Stolen property</li><li>Tobacco products and related items, including e-cigarettes</li><li>Used cosmetics</li><li>Used undergarments</li><li>Used or rebuilt batteries or batteries containing mercury</li><li>Weapons and related items (including, but not limited to firearms, firearm accessories, parts and magazines, ammunition, paintball guns, gel blaster guns, BB and pellet guns, , tear gas, tasers, stun guns, switchblade knives, martial arts weapons, archery and/or bow and arrow equipment)</li><li>Ivory, rhino horn or any animal parts or&nbsp;hunting trophies listed in the CITES 1 guidelines</li><li>Votes in elections administered by the Australian Electoral Commission or state-based Electoral Commission</li><li>Census or other survey papers issued by the Australian Bureau of Statistic</li><li>Electric dog collars (Training E-Collar, Shock Collar, Anti Bark Collar)</li></ol><p>&nbsp;</p>',	NULL,	NULL,	'Coming Soon',	'We are hardly trying to launch our website',	'Under Construction',	'Our website is under construction :)',	'Opps! Page Not Found!',	'We didn\'t find the page for you. Please go back to home page.',	'frontend/images/bg/error.png',	'Opps! Page Not Found!',	'We didn\'t find the page for you. Please go back to home page.',	'frontend/default_images/error-banner.png',	'Opps! Page Not Found!',	'We didn\'t find the page for you. Please go back to home page.',	'frontend/default_images/error-banner.png',	'2022-08-19 23:31:12',	'2023-04-27 05:26:16');
