(20,	66,	'Lorem Ipsum is simply dummy text',	'lorem-ipsum-is-simply-dummy-text',	'The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. S',	'<p style=\"margin-bottom: 15px; text-align: justify; color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</p><div><br></div>',	'2023-03-17',	'15:23:00',	'15:20:00',	'2023-03-14',	NULL,	0,	'uploads/events/1679563284_641c1a14b1d18.png',	'[\"46\"]',	'[\"2\",\"1\",\"7\",\"6\",\"5\"]',	1,	NULL,	0,	8,	'[]',	1,	1,	'#',	3243434.00,	'2023-03-23 20:21:25',	NULL,	66,	NULL),
