(47,	26,	'Best friend gathering',	'best-friend-gathering',	'Truly great friends are hard to find, difficult to leave, and impossible to forge. It\'s the friends you can call up at 4 a.m. that matter',	'<p><span style=\"color: rgb(77, 81, 86); font-family: &quot;Google Sans&quot;, arial, sans-serif;\">association, caucus, collection, conclave, conference, congregation, convention, crowd, function, group, mass, meeting, party, throng, acquisition, affair, aggregate, aggregation, band, body.</span><span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align); background-color: rgba(80, 151, 255, 0.18); color: rgb(4, 12, 40); font-family: &quot;Google Sans&quot;, arial, sans-serif;\">a coming together of people in a group (as for social, religious, or political purposes)</span><span style=\"font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align); color: rgb(77, 81, 86); font-family: &quot;Google Sans&quot;, arial, sans-serif;\">&nbsp;: assembly, meeting. an informal gathering.</span><span style=\"color: rgb(77, 81, 86); font-family: &quot;Google Sans&quot;, arial, sans-serif; font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">It\'s been used for decades by people describing their closest confidants, but it began appearing in dictionaries as a slang term some time after 2010</span></p><p><span class=\"ILfuVd\" lang=\"en\" style=\"font-size: medium; line-height: 24px; color: rgb(77, 81, 86); font-family: &quot;Google Sans&quot;, arial, sans-serif;\"><span class=\"hgKElc\" style=\"padding-right: 8px;\">A true friend is&nbsp;<span style=\"background-color: rgba(80, 151, 255, 0.18); color: rgb(4, 12, 40);\">someone you can rely on when you need it</span>. They treat you with respect, and being around them makes you feel good. They have your best interest at heart. You feel comfortable being yourself with them, and you can trust them</span></span></p><div class=\"co8aDb\" aria-level=\"3\" role=\"heading\" style=\"margin-bottom: 12px; color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, arial, sans-serif;\"><b>Short Best Friend Captions For Instagram</b></div><div class=\"RqBzHd\" style=\"padding-right: 20px; padding-left: 20px; color: rgb(32, 33, 36); font-family: &quot;Google Sans&quot;, arial, sans-serif;\"><ul class=\"i8Z77e\"><li class=\"TrT0Xe\" style=\"margin-bottom: 4px; list-style-type: disc;\">Friends \'till the end.</li><li class=\"TrT0Xe\" style=\"margin-bottom: 4px; list-style-type: disc;\">A true friend is one soul in two bodies.</li><li class=\"TrT0Xe\" style=\"margin-bottom: 4px; list-style-type: disc;\">Your vibe attracts your tribe.</li><li class=\"TrT0Xe\" style=\"margin-bottom: 4px; list-style-type: disc;\">Friends don\'t let friends do silly things alone.</li><li class=\"TrT0Xe\" style=\"margin-bottom: 4px; list-style-type: disc;\">I\'ll even send you the photos I look bad in.</li><li class=\"TrT0Xe\" style=\"margin-bottom: 4px; list-style-type: disc;\">Besides chocolate, you\'re my favorite.</li><li class=\"TrT0Xe\" style=\"margin-bottom: 4px; list-style-type: disc;\">Love is beautiful, friendship is better</li></ul><p style=\"margin-bottom: 4px; list-style-type: disc;\"><br></p><p style=\"margin-bottom: 4px; list-style-type: disc;\"><span style=\"color: rgb(77, 81, 86);\">If you and your friend have&nbsp;</span><span style=\"background-color: rgba(80, 151, 255, 0.18); color: rgb(4, 12, 40);\">trust, equality, compassion, honesty, and independence</span><span style=\"color: rgb(77, 81, 86);\">, you already have the foundation of a strong and healthy friendship. Even though it can be hard to recognize when a friendship is weak in some areas, it is always possible to improve yourself and your relationship with a friend.</span><br></p></div><p><span class=\"ILfuVd\" lang=\"en\" style=\"font-size: medium; line-height: 24px; color: rgb(77, 81, 86); font-family: &quot;Google Sans&quot;, arial, sans-serif;\"><span class=\"hgKElc\" style=\"padding-right: 8px;\"></span></span><br></p>',	'2023-05-31',	'12:29:00',	'12:30:00',	'2023-05-25',	NULL,	0,	'uploads/events/1685428112_64759790b8b13.jpg',	'[\"3\",\"46\",\"28\",\"35\",\"7\"]',	'[\"1\",\"6\",\"3\"]',	1,	NULL,	0,	32,	'[15,16]',	1,	1,	'friend-parti.com',	23.00,	'2023-05-30 17:28:32',	NULL,	26,	NULL),
